	('efeb15b9-76c5-439d-8ece-817582b43451', '41526fa4-7646-4001-8641-7d33269afac1', 'Tiramis', '00:10:00', 600.00, NULL, NULL, '{"Get a baking dish of around 30x20 cm.","Soak the savoiardi biscuits for a few seconds on both sides in the cooled, sweetened coffee.","Distribute a layer of soaked savoiardi on the bottom of the dish.","Spread a generous layer of mascarpone cream over the biscuits.","Repeat the process, creating layers of soaked savoiardi and cream.","Ensure the final layer is cream, making it smooth for presentation.","Dust the top with bitter cocoa powder.","Refrigerate the tiramis for at least a couple of hours before serving."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-10-05 14:56:27.63998+00', 'Dish', 'g', 'b5464301-908c-58ab-8b17-b3828776b743', 'bitter cocoa powder mascarpone cream savoiardi biscuits sweetened coffee|get a baking dish of around  x  cm  soak the savoiardi biscuits for a few seconds on both sides in the cooled  sweetened coffee  distribute a layer of soaked savoiardi on the bottom of the dish  spread a generous layer of mascarpone cream over the biscuits  repeat the process  creating layers of soaked savoiardi and cream  ensure the final layer is cream  making it smooth for presentation  dust the top with bitter cocoa powder  refrigerate the tiramis for at least a couple of hours before serving'),
	('9c975cb7-dae7-4ea7-af98-f59b77ae37fd', NULL, 'Bizcocho de Zanahoria', '00:30:00', 1.00, NULL, NULL, '{"Mezclar el huevo entero con el azcar, envasar al vaco.","Calentar en la Roner a 58 grados durante 20 minutos.","Poner el huevo a montar con varillas hasta que se enfre la mezcla.","Tamizar las partes secas al huevo montado, moverlo suavemente con una lengua.","Pasar la masa al molde redondo engrasado y cocinar a 180 grados, H25, V4 durante unos 30 minutos.","Antes de sacar del horno, pinchar el medio para asegurar que est bien cocinado.","Enfriar bien del todo, quitar la costra del borde y encima, partir el bizcocho horizontalmente por la mitad, reservar en congelador."}', '7667066b-6a66-4fbf-8902-625d535798dc', '2025-09-20 17:33:43.471094+00', 'Preparation', 'x', '13c5dcd8-7431-5fc2-be12-170a6edf3d31', 'azcar de flor de coco harina floja huevos mezcla de especias polvo levadura royal sal|mezclar el huevo entero con el azcar  envasar al vaco  calentar en la roner a   grados durante   minutos  poner el huevo a montar con varillas hasta que se enfre la mezcla  tamizar las partes secas al huevo montado  moverlo suavemente con una lengua  pasar la masa al molde redondo engrasado y cocinar a   grados  h  v  durante unos   minutos  antes de sacar del horno  pinchar el medio para asegurar que est bien cocinado  enfriar bien del todo  quitar la costra del borde y encima  partir el bizcocho horizontalmente por la mitad  reservar en congelador'),
	('412dc85f-1d16-463e-9de1-59d1317193fe', 'f195b1a3-91c7-48b0-b5b4-63cead27976e', 'Spaghetti Pomodoro e basilico', '00:20:00', 90.00, NULL, NULL, '{"Mettere l''acqua a bollire.","Schiacciare 2 spicchi di aglio.","Aggiungere 3 cucchiai di olio quando l''olio  bollente.","Aggiungere il pomodoro.","Mettere gli spaghetti nell''acqua (11 minuti).","Aggiungere il basilico nel pomodoro (tritato o intero).","Quando  lista e cotta il sugo  pronto.","Mescolare con mezzo mestolo di acqua della pasta e un po'' di burro."}', 'b6fac464-1cb7-4474-b109-917fa33d5d54', '2025-07-12 13:18:18.380561+00', 'Dish', 'g', 'ae5ddbcc-cc0a-5d42-97e5-a5ed1eeb8652', 'spaghetti sugo di pomodoro e basilico|mettere l acqua a bollire  schiacciare   spicchi di aglio  aggiungere   cucchiai di olio quando l olio  bollente  aggiungere il pomodoro  mettere gli spaghetti nell acqua   minuti  aggiungere il basilico nel pomodoro  tritato o intero  quando  lista e cotta il sugo  pronto  mescolare con mezzo mestolo di acqua della pasta e un po  di burro'),
	('a466ddc5-4cc3-4bb3-aea9-b60df3ee2346', NULL, 'Chocolate Tart', '00:30:00', 100.00, NULL, NULL, NULL, 'bdc44a77-6aaf-4039-bb52-d853fdff2364', NULL, 'Dish', 'g', '5cbbe40c-9363-5d31-9c48-1ad0ec0cd909', ''),
	('57159ab4-f635-4158-afb9-18a7854fa0a3', 'e9248f49-a61a-4c38-a693-ee0e08fb8442', 'Crispy Fish Sticks with Mushy Peas', '00:30:00', 4.00, 'Ensure fish sticks are golden and crispy.', NULL, '{"Serve crispy fish sticks with mushy peas."}', 'ff3f850e-a473-43d9-9520-a9959be26dbd', '2025-07-11 10:53:49.102491+00', 'Dish', 'x', '0a140e33-d698-543e-9042-e2f71332ac88', 'crispy fish sticks mushy peas|serve crispy fish sticks with mushy peas'),
	('7522635d-6321-4529-958e-a76b9198bc14', NULL, 'Poached Leek', '00:20:00', 1900.00, NULL, NULL, '{"Take the white part of the leek and make small incisions with a knife.","Combine the leek with miso and vegetable stock in a pan.","Poach until the leek is soft."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', '9547cc31-9b0d-53ff-836e-40323a790f03', 'leek vegetable stock white miso|take the white part of the leek and make small incisions with a knife  combine the leek with miso and vegetable stock in a pan  poach until the leek is soft'),
	('c35a4bf2-cba9-4e97-8060-1e96ddeaad92', NULL, 'Gazpacho', '00:20:00', 285.00, NULL, NULL, '{"Lavar y trocear los tomates, el pimiento y la cebolla tierna.","Pelar el pepino, quitarle las semillas y trocearlo.","Pelar el ajo.","Colocar todas las verduras, el pan y la sal en el vaso de una batidora.","Aadir el agua y triturar todo a mxima potencia hasta obtener una crema fina.","Sin dejar de batir, aadir el aceite de oliva y el de girasol en un hilo fino para que emulsione.","Pasar el gazpacho por un colador fino para eliminar pieles y semillas.","Refrigerar en la nevera durante al menos una hora antes de servir."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Dish', 'g', 'b79dcc5e-a775-5dbd-a116-044aec85c7a0', 'aceite de girasol aceite de oliva virgen extra agua ajo cebolla tierna pan pepino pimiento sal tomate|lavar y trocear los tomates  el pimiento y la cebolla tierna  pelar el pepino  quitarle las semillas y trocearlo  pelar el ajo  colocar todas las verduras  el pan y la sal en el vaso de una batidora  aadir el agua y triturar todo a mxima potencia hasta obtener una crema fina  sin dejar de batir  aadir el aceite de oliva y el de girasol en un hilo fino para que emulsione  pasar el gazpacho por un colador fino para eliminar pieles y semillas  refrigerar en la nevera durante al menos una hora antes de servir'),
	('046cf913-50c9-43b8-b2d8-ff483fffa7a6', NULL, 'H. Mat', '00:30:00', 1.00, NULL, NULL, '{"Preparar la mezcla segn las instrucciones anteriores."}', 'dc9ed5aa-54c9-4df5-b9a4-959e71a39ef8', '2025-07-10 17:04:03.497378+00', 'Dish', 'x', 'b304b949-2bea-5ab6-9b43-4a5a346ef633', 'mezcla de ingredientes|preparar la mezcla segn las instrucciones anteriores'),
	('15054aa4-ad39-4a40-9d32-906a066c863f', NULL, 'Pia colada', '00:05:00', 270.00, NULL, NULL, '{"Juntar todo y reservar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'ml', '92bbb18d-2667-5df2-b2e0-3d78852580b9', 'agua de coco pimienta blanca molida ron sal zumo de pia natural|juntar todo y reservar'),
	('eac58af3-399d-460b-a52d-91099b29ec80', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Turrn salado', '00:10:00', 240.00, '', NULL, '{"Juntar todo y triturar hasta dejar muy fino.",Colar.}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'ml', '33de5838-6ae3-5386-a73a-0ccdb6e08414', 'agua pimienta blanca molida sal|juntar todo y triturar hasta dejar muy fino  colar'),
	('c71a2128-59a7-4e9e-8ae3-6a51e7f2234f', 'a1f49f4f-80a6-423b-91d0-ed01bd478d17', 'Korean Ssamjang Dip', '00:10:00', 1.00, 'You can serve this dip with raw vegetables or use it as a dip for Korean-style steamed dishes.', NULL, '{"In a blender, combine the jalapeo, gochujang, doenjang or white miso paste, garlic, scallions, soy sauce, sesame oil, rice vinegar, and sugar (if using). Blend until smooth.","Taste and adjust the seasoning as needed.","Serve with raw vegetables."}', '2ab0aeb0-c8e9-4df9-b32b-7a10dd18dbb6', NULL, 'Dish', 'cup', '0db94803-a187-5be8-b4d5-6cff03fecb8f', 'ssamjang dip|in a blender  combine the jalapeo  gochujang  doenjang or white miso paste  garlic  scallions  soy sauce  sesame oil  rice vinegar  and sugar  if using  blend until smooth  taste and adjust the seasoning as needed  serve with raw vegetables'),
	('e5ebfe86-99be-4a62-9468-47ea78f86e05', NULL, 'Leek Sauce', '01:50:00', 350.00, NULL, NULL, '{"Tightly burn the green leek stems.","Add water and cook for 90 minutes.","Pass the mixture through a sieve, reserving the liquid.","Add the remaining vegetable stock to the reserved leek liquid.","Reduce the sauce until it reaches a demi-glace consistency."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-09-15 00:28:44.427581+00', 'Preparation', 'ml', '447c7c03-b558-55af-979f-231e6735b2c1', 'leek water|tightly burn the green leek stems  add water and cook for   minutes  pass the mixture through a sieve  reserving the liquid  add the remaining vegetable stock to the reserved leek liquid  reduce the sauce until it reaches a demi glace consistency'),
	('e2c3083d-0deb-4c0c-a213-bfe2d79f36bc', NULL, 'Mascarpone Cream', '00:15:00', 1.00, '', NULL, '{"Carefully separate the egg whites from the yolks into two separate bowls.","With electric whips, mix the yolks with half of the sugar (115g) until it is lighter and fluffy.","Gradually add the mascarpone cheese to the yolk mixture and mix until the cream is dense and compact.","Set the mascarpone-yolk cream aside.","Clean your electric whips.","In the other bowl, mix the egg whites with the other half of the sugar (115g).","Whip until the mixture is firm and holds stiff peaks.","Gradually, spoon by spoon, fold the whipped egg whites into the mascarpone-yolk cream.","Mix softly from top to bottom until fully incorporated."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', 'e7fa5e9d-a43b-5099-abd8-94afe1054181', 'eggs mascarpone cheese sugar|carefully separate the egg whites from the yolks into two separate bowls  with electric whips  mix the yolks with half of the sugar  g  until it is lighter and fluffy  gradually add the mascarpone cheese to the yolk mixture and mix until the cream is dense and compact  set the mascarpone yolk cream aside  clean your electric whips  in the other bowl  mix the egg whites with the other half of the sugar  g  whip until the mixture is firm and holds stiff peaks  gradually  spoon by spoon  fold the whipped egg whites into the mascarpone yolk cream  mix softly from top to bottom until fully incorporated'),
	('8569185d-5c43-4727-986a-119ffbd609de', NULL, 'Sweetened Coffee', '00:05:00', 1.00, '', NULL, '{"Brew 4 cups of coffee.","Allow the coffee to cool completely.","Sweeten the coffee with sugar as you prefer."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', 'dcda7e08-ee7c-55ab-a5fe-15b6af9acda8', 'coffee sugar|brew   cups of coffee  allow the coffee to cool completely  sweeten the coffee with sugar as you prefer'),
	('08c69254-63c0-42bb-8f82-15c5bad92804', NULL, 'Salsa de Apio', '00:25:00', 1.00, '', NULL, '{"Limpiar y picar el apio y la cebolla.","Pochar las verduras en una cacerola con aceite de oliva hasta que estn blandas.","Aadir el caldo de pescado y llevar a ebullicin.","Bajar el fuego y cocinar a fuego lento durante 15 minutos.","Triturar la mezcla con una batidora hasta obtener una salsa fina y homognea.","Pasar la salsa por un colador fino si se desea una textura ms suave.","Sazonar al gusto."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', '4e7c47c7-e9ea-51c5-83d9-b0f5c5c2b86e', 'aceite de oliva apio caldo de pescado cebolla sal|limpiar y picar el apio y la cebolla  pochar las verduras en una cacerola con aceite de oliva hasta que estn blandas  aadir el caldo de pescado y llevar a ebullicin  bajar el fuego y cocinar a fuego lento durante   minutos  triturar la mezcla con una batidora hasta obtener una salsa fina y homognea  pasar la salsa por un colador fino si se desea una textura ms suave  sazonar al gusto'),
	('d77bab20-5dcc-4dfd-b9a7-a1220bc5bf37', NULL, 'Aceite de limn', '01:35:00', 1.00, '', NULL, '{}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Preparation', 'x', '21b6ea70-912a-5546-a941-fd0f8de2d34e', 'aceite de girasol limn|'),
	('c8200eb7-6285-42a2-af93-f50e51cf7858', NULL, 'Sugo di Pomodoro e Basilico', '00:15:00', 1.00, NULL, NULL, '{"Schiacciare 2 spicchi di aglio.","Aggiungere 3 cucchiai di olio quando l''olio  bollente.","Aggiungere il pomodoro.","Aggiungere il basilico nel pomodoro (tritato o intero)."}', 'b6fac464-1cb7-4474-b109-917fa33d5d54', NULL, 'Preparation', 'x', 'e1d317a2-8ca5-5d32-92e6-3aa83ebc8384', 'basil butter garlic olive oil tomato|schiacciare   spicchi di aglio  aggiungere   cucchiai di olio quando l olio  bollente  aggiungere il pomodoro  aggiungere il basilico nel pomodoro  tritato o intero'),
	('de2c3bd6-4d72-4598-ba8d-bd401e505941', NULL, 'Leek Sauce', '00:30:00', 1.00, NULL, NULL, '{"Tightly braised with water.","Cook for 1 hour and 30 minutes.","Pass through a sieve.","Reduce until almost dry."}', '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-08-07 09:23:25.552816+00', 'Preparation', 'x', '4a99986e-74cf-5ff5-8779-45bfc41224cc', 'butter leek|tightly braised with water  cook for   hour and   minutes  pass through a sieve  reduce until almost dry'),
	('dfe537f9-2a03-46e9-bd8d-a482e954d343', '21e104b3-a875-40a7-b3d7-2221c2e9bb88', 'Tartar de Salmn con Arroz de Sushi', '00:10:00', 282.00, 'Asegurarse de que todos los componentes estn fros antes de montar el plato para mantener la frescura.', NULL, '{"Colocar una base de arroz de sushi en un plato o molde.","Aadir una capa de tartar de salmn sobre el arroz.","Salsear con la mayonesa ctrica.","Terminar con alga nori cortada en tiras finas."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-11-29 17:52:29.743686+00', 'Dish', 'g', '59993a28-f917-5ac9-8ca7-5ecaeef92fc3', 'alga nori arroz sushi salsa mayo ctrica tartar salmn|colocar una base de arroz de sushi en un plato o molde  aadir una capa de tartar de salmn sobre el arroz  salsear con la mayonesa ctrica  terminar con alga nori cortada en tiras finas'),
