	('d78f3589-8d4f-4ab6-828c-de71f90e06ba', '21e104b3-a875-40a7-b3d7-2221c2e9bb88', 'Pescado Confitado con Pisto', '00:10:00', 180.00, NULL, NULL, '{"Colocar una base de pisto en el plato.","Disponer el pescado confitado sobre el pisto.","Salsear con la salsa de apio para terminar."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-12-15 21:45:30.678312+00', 'Dish', 'g', 'f69d5062-188c-5110-bca6-645de358378f', 'pescado confitado pisto salsa de apio|colocar una base de pisto en el plato  disponer el pescado confitado sobre el pisto  salsear con la salsa de apio para terminar'),
