	('b579f6f2-278e-4690-bc76-1d64e83f9eaf', NULL, 'Turkey and Vegetable Mixture', '00:20:00', 1.00, NULL, NULL, '{"Heat half of the olive oil in a large frying pan over medium heat.","Add the onions and garlic, cook for 5 minutes or until onions are translucent.","Add the meat, and cook until browned.","Add the mushrooms, carrots, celery, Italian seasoning, and salt.","Continue to cook for a few minutes, until the meat is cooked through.","Remove from heat."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', 'f50de9eb-dfa7-590b-9e9e-587b71cfc37f', 'carrots celery extra lean ground turkey extra virgin olive oil garlic italian seasoning mushrooms sea salt yellow onion|heat half of the olive oil in a large frying pan over medium heat  add the onions and garlic  cook for   minutes or until onions are translucent  add the meat  and cook until browned  add the mushrooms  carrots  celery  italian seasoning  and salt  continue to cook for a few minutes  until the meat is cooked through  remove from heat'),
	('cb96a6d2-9f6b-48ab-bcef-d35f6d1a54fd', NULL, 'Mushy Peas', '00:10:00', 1.00, NULL, NULL, '{"Boil or steam frozen peas until tender.","Mash with butter and season with salt."}', 'ff3f850e-a473-43d9-9520-a9959be26dbd', NULL, 'Preparation', 'x', '3dc07be2-f8bc-565f-aed0-3ec58a13e301', 'butter frozen peas salt|boil or steam frozen peas until tender  mash with butter and season with salt'),
	('9f95a2c3-cecd-49b1-baff-9a77e77862a8', NULL, 'Salmn Confitado en Aceite de Limn', '00:20:00', 1.00, '', NULL, '{"Racionar el salmn en porciones de 200g, sin espinas.","Salpimentar las porciones de salmn.","Envasar al vaco el salmn con el aceite de limn.","Congelar durante un mnimo de 48 horas.","Para cocinar, cocer al vapor a 60C durante unos minutos, dependiendo del grosor de la racin.","Dejar enfriar despus de la coccin."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Preparation', 'x', '5662bb1b-3545-5c2d-8b7e-d53d3b311141', 'aceite de limn pimienta negra sal salmn|racionar el salmn en porciones de  g  sin espinas  salpimentar las porciones de salmn  envasar al vaco el salmn con el aceite de limn  congelar durante un mnimo de   horas  para cocinar  cocer al vapor a  c durante unos minutos  dependiendo del grosor de la racin  dejar enfriar despus de la coccin'),
	('936b3fe1-8afa-42b8-b44a-17a9bd4c429d', NULL, 'Crispy Fish Sticks', '00:15:00', 1.00, NULL, NULL, '{"Cut fish fillets into stick shapes.","Dredge fish sticks in flour, then dip in beaten eggs, and coat with breadcrumbs.","Fry until golden and crispy."}', 'ff3f850e-a473-43d9-9520-a9959be26dbd', NULL, 'Preparation', 'x', '607b3a08-2487-5c82-97c0-0633d41f3878', 'breadcrumbs eggs fish fillets flour pepper salt|cut fish fillets into stick shapes  dredge fish sticks in flour  then dip in beaten eggs  and coat with breadcrumbs  fry until golden and crispy'),
