	('4aa6bd7b-52b5-471d-b582-b71db558a6ae', '1250907a-b901-4cf6-88e9-efb78d392e1d', 'Tuile all''Aa', '00:30:00', 1.00, 'La farina pu essere sostituita con farina senza glutine se necessario.', NULL, '{"Mescolare tutti gli ingredienti insieme nella planetaria con la frusta a foglia.","Stendere il composto sugli stampi.","Cuocere a 160C con valvola aperta e ventilazione massima per 8 minuti.","Rimuovere dagli stampi e modellarli mentre sono caldi."}', 'dd00cb07-8b38-4c14-9385-2bdf4bef16bb', '2025-09-16 21:04:40.692469+00', 'Preparation', 'x', 'ad29aef6-1dcf-51cb-86b6-f154d9e839ee', 'albumi burro farina polvere di acai zucchero|mescolare tutti gli ingredienti insieme nella planetaria con la frusta a foglia  stendere il composto sugli stampi  cuocere a  c con valvola aperta e ventilazione massima per   minuti  rimuovere dagli stampi e modellarli mentre sono caldi'),
	('8b830d29-ad95-48c9-b352-296d3adaa4dc', NULL, 'Mezcla de Ingredientes', '00:30:00', 1.00, NULL, NULL, '{"Mezclar leche y nata a 40C.","Aadir los ingredientes secos.","Calentar a 83C.","Aadir el sarro y el mat."}', 'dc9ed5aa-54c9-4df5-b9a4-959e71a39ef8', NULL, 'Preparation', 'x', 'fd5b9527-c67a-519c-9ddd-2a5199461bcd', 'azcares dextrosa estabilizante leche mat nata sal|mezclar leche y nata a  c  aadir los ingredientes secos  calentar a  c  aadir el sarro y el mat'),
	('4bc9f164-9169-4b0a-bacb-3af5f5c34f27', NULL, 'Cauliflower Foam', '00:25:00', 1300.00, NULL, NULL, '{"Melt the butter in a pan.","Add the cauliflower and cook until it gets a nice colour.","Add the cream and continue to cook until the cauliflower is very soft.","Transfer the mixture to a blender and blend until smooth."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', '75940027-7a3d-50c2-a9ff-4d83a7511044', 'butter cauliflower cream|melt the butter in a pan  add the cauliflower and cook until it gets a nice colour  add the cream and continue to cook until the cauliflower is very soft  transfer the mixture to a blender and blend until smooth'),
