	('568e5750-e786-4e22-bf9e-e4514fe1d817', NULL, 'Crema Montada de Zanahoria', '00:20:00', 1.00, NULL, NULL, '{"Licuar las zanahorias hasta obtener 700ml.","En un cazo amplio agregar el licuado con la glucosa, reducir a la mitad de su volumen."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'x', '86a63514-5db5-5d16-96c3-a7dfd1f71af3', 'choco blanco colorante amarillo gelatina glucosa lquida nata 35%mg vaina de vainilla zanahoria|licuar las zanahorias hasta obtener  ml  en un cazo amplio agregar el licuado con la glucosa  reducir a la mitad de su volumen'),
	('01625d43-5549-4d2f-84cb-6734ba7a0312', NULL, 'Crujiente de pollo', '00:25:00', 1.00, '', NULL, '{"Retirar el exceso de grasa de la piel de pollo.","Estirar la piel sobre un papel sulfurizado.","Congelar la piel estirada.","Precalentar el horno a 190C.","Hornear durante 20 minutos con una placa encima para evitar que se doble.","Salpimentar al gusto.","Reservar en un lugar seco."}', 'dd005247-66c4-44d9-af83-ed081c2cfe52', NULL, 'Preparation', 'x', 'bc4bc84d-7323-5973-904d-3c8a766bd7cd', 'piel de pollo pimienta sal|retirar el exceso de grasa de la piel de pollo  estirar la piel sobre un papel sulfurizado  congelar la piel estirada  precalentar el horno a  c  hornear durante   minutos con una placa encima para evitar que se doble  salpimentar al gusto  reservar en un lugar seco'),
	('91449467-a110-4b08-a6ea-4ab9c296c27e', NULL, 'Crujiente de Pollo con Holandesa y Bechamel', '00:10:00', 1.00, NULL, 'unidades', '{"Colocar una base de crujiente de pollo en el plato.","Salsear con la holandesa.","Aadir el jamn ibrico en brunoise.","Dispensar la espuma de bechamel por encima.","Espolvorear con el panco tostado para terminar.","Servir inmediatamente."}', 'dd005247-66c4-44d9-af83-ed081c2cfe52', NULL, 'Dish', 'x', 'a8b1b29c-86b7-5aa6-9659-7af281feac1c', 'crujiente de pollo espuma de bechamel holandesa jamn ibrico en brunoise panco tostado|colocar una base de crujiente de pollo en el plato  salsear con la holandesa  aadir el jamn ibrico en brunoise  dispensar la espuma de bechamel por encima  espolvorear con el panco tostado para terminar  servir inmediatamente'),
