	('fa1bdca2-c244-48a5-b3ab-a1f16562677c', NULL, 'Pickling Liquid', '00:20:00', 1.00, NULL, NULL, '{"Make a sachet d''epices with the mustard, peppercorn, and garlic.","In a pot, combine the vinegar, water, salt, chili flakes, and the sachet.","Bring to a boil, then cool down. Add dill."}', '2ab0aeb0-c8e9-4df9-b32b-7a10dd18dbb6', NULL, 'Preparation', 'x', '0ea59fdb-8ab2-5935-9e1d-fce20472f074', 'apple cider vinegar black peppercorn dill garlic red chili flakes salt shallot water yellow mustard seed|make a sachet d epices with the mustard  peppercorn  and garlic  in a pot  combine the vinegar  water  salt  chili flakes  and the sachet  bring to a boil  then cool down  add dill'),
