	('4dc5291b-d1bf-487b-acca-aead371b20cd', NULL, 'Relleno de Pollo y Manzana', '00:45:00', 6800.00, '', NULL, '{"Hacer una roux fundiendo la mantequilla y aadiendo posteriormente la harina, cocinando sin que se llegue a tostar.","Aadir la leche y remover hasta que hierva.","Poner a punto de sal, pimienta y nuez moscada, esta ltima un punto por encima.","Una vez lista la bechamel, y con el fuego bajo, aadir la base del relleno y la cebolla negra.","Remover hasta que vuelva a hervir.","Aadir la carne de pollo y dejar cocer hasta que vuelva a hervir, removiendo con cuidado de que no se agarre.","Una vez haya hervido, poner a punto de sal todo junto.","Retirar del fuego.","Cortar la manzana en brunoise.","Aadir la manzana cortada a brunoise y enfriar."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Preparation', 'g', '6c16725f-46c5-5313-8b05-1706aac2a9e1', 'base del relleno carne de pollo asado cebolla negra harina de trigo leche semidesnatada mantequilla manzana golden nuez moscada pimienta negra molida sal|hacer una roux fundiendo la mantequilla y aadiendo posteriormente la harina  cocinando sin que se llegue a tostar  aadir la leche y remover hasta que hierva  poner a punto de sal  pimienta y nuez moscada  esta ltima un punto por encima  una vez lista la bechamel  y con el fuego bajo  aadir la base del relleno y la cebolla negra  remover hasta que vuelva a hervir  aadir la carne de pollo y dejar cocer hasta que vuelva a hervir  removiendo con cuidado de que no se agarre  una vez haya hervido  poner a punto de sal todo junto  retirar del fuego  cortar la manzana en brunoise  aadir la manzana cortada a brunoise y enfriar'),
	('62208202-6c71-4163-a408-0ad0a7f16915', 'a28222de-a59c-4671-82ed-7b5746dc14dd', 'Leek, Leek', '01:30:00', 200.00, NULL, NULL, '{"Poach the leeks.","Make the leek sauce.","Prepare the cauliflower foam.","Serve together."}', '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-08-05 15:30:39.597953+00', 'Dish', 'g', 'e332f9b4-ac7b-507f-b24a-ed87e96c5d13', 'cauliflower foam leek sauce poached leek|poach the leeks  make the leek sauce  prepare the cauliflower foam  serve together'),
	('5b66fd41-9a10-45b6-bde6-1e106a8cf143', NULL, 'Carrot Cake', '01:00:00', 1.00, NULL, 'slice', '{"Antes de montar la crema, tiene que descongelarlos del todo, y pintar un poco de almbar para humedecer el bizcocho."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'x', '0862710f-ccb3-55a8-b268-f8f8e6268f8c', 'bizcocho de zanahoria crema montada de zanahoria|antes de montar la crema  tiene que descongelarlos del todo  y pintar un poco de almbar para humedecer el bizcocho'),
	('15881ec0-ce1a-4e66-ac69-f0202a0c2df7', NULL, 'Salsa Gialla per Pesce Lessso', '00:20:00', 100.00, 'The sauce should be smooth and creamy. Adjust seasoning as needed.', NULL, '{"In a small saucepan, heat 20g of butter over low heat.","Add 20g of flour and mix well to create a roux.","Cook for a few minutes until the roux is lightly golden.","Gradually add 400g of fish cooking liquid, whisking continuously to avoid lumps.","Bring the mixture to a boil, then reduce the heat and simmer for a few minutes until it thickens.","Remove from heat and stir in the egg yolk mixed with a squeeze of lemon juice.","Season with salt and pepper to taste.","Serve hot."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'ml', '081d39d8-cc66-507a-8839-e4b72726287a', 'butter egg yolks fish cooking liquid flour lemon pepper salt|in a small saucepan  heat  g of butter over low heat  add  g of flour and mix well to create a roux  cook for a few minutes until the roux is lightly golden  gradually add  g of fish cooking liquid  whisking continuously to avoid lumps  bring the mixture to a boil  then reduce the heat and simmer for a few minutes until it thickens  remove from heat and stir in the egg yolk mixed with a squeeze of lemon juice  season with salt and pepper to taste  serve hot'),
	('8ee812fc-f52f-488d-98d0-af4b1fea16d3', NULL, 'Eclair Tiramis', '02:00:00', 1.00, NULL, NULL, '{"Prepare choux pastry and pipe into clairs.","Bake until golden.","Fill with coffee cremoso.","Top with bizcocho terengue."}', 'ff1396ea-664c-4c80-b654-2136da431207', NULL, 'Dish', 'x', '7d87ae54-2109-5024-8dc9-b08f5e63b21a', 'bizcocho terengue crema mascarpone cremoso de caf pasta choux|prepare choux pastry and pipe into clairs  bake until golden  fill with coffee cremoso  top with bizcocho terengue'),
	('113dedf9-b4f9-49d2-936c-6678e53b71f3', NULL, 'Guisante', '00:30:00', 300.00, NULL, NULL, '{"Cocer la patata en agua ligeramente salada.","Cuando falten 5 minutos aadir los guisantes.","Escurrir (reservar agua de coccin) y enfriar en agua helada.","Triturar con su propia agua cuando est fra.","Aadir la menta.","Rectificar condimentacin y colar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'ml', '9da1aea4-6d33-5d59-8f5f-aecd4f21e9db', 'agua guisantes menta fresca patata sal|cocer la patata en agua ligeramente salada  cuando falten   minutos aadir los guisantes  escurrir  reservar agua de coccin  y enfriar en agua helada  triturar con su propia agua cuando est fra  aadir la menta  rectificar condimentacin y colar'),
	('92644b0c-c88c-48b6-bb14-7b57356ebaf5', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Patata Souffl', '00:30:00', 125.00, 'La tcnica requiere dos temperaturas de aceite distintas para lograr el inflado (souffl).', NULL, '{"Pelar las patatas, cuadricularlas y cortar en lminas de 2 mm.","Cocer en abundante aceite a 100C hasta que estn tiernas y aparezcan unas pequeas burbujas.","Pasar a otra sartn con aceite a 180C hasta obtener el aspecto souffl.","Bajar la temperatura del aceite y continuar hasta dejar doradas y crujientes."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', '3f1ded5f-fffb-5dbf-b887-84cd3a01b6f4', 'aceite de oliva patata agria|pelar las patatas  cuadricularlas y cortar en lminas de   mm  cocer en abundante aceite a  c hasta que estn tiernas y aparezcan unas pequeas burbujas  pasar a otra sartn con aceite a  c hasta obtener el aspecto souffl  bajar la temperatura del aceite y continuar hasta dejar doradas y crujientes'),
	('76684bd6-2cc7-4e6e-b36b-624ecf551dfe', NULL, 'Pescado Confitado', '00:25:00', 1.00, '', NULL, '{"Salar los lomos de pescado.","Calentar el aceite de oliva en una cacerola a fuego muy bajo con los ajos.","Introducir el pescado en el aceite, asegurndose de que quede completamente cubierto.","Cocinar a baja temperatura (aproximadamente 65C) durante 15-20 minutos, hasta que las lascas se separen fcilmente.","Retirar el pescado del aceite con cuidado y escurrir."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', 'afb8e6e5-98ba-5a76-8fca-41289bffe878', 'aceite de oliva ajo pescado blanco sal|salar los lomos de pescado  calentar el aceite de oliva en una cacerola a fuego muy bajo con los ajos  introducir el pescado en el aceite  asegurndose de que quede completamente cubierto  cocinar a baja temperatura  aproximadamente  c  durante   minutos  hasta que las lascas se separen fcilmente  retirar el pescado del aceite con cuidado y escurrir'),
	('922c20fe-e228-498c-a850-3303986ac0cb', NULL, 'Poached Leek', '00:30:00', 1.00, NULL, NULL, '{"Have small ''noves with a wine''.","Stock and poach till soft."}', '2010da74-6360-44c5-9b63-db0cd17a6530', NULL, 'Preparation', 'x', '3b32bdac-78c3-5be8-be8a-1832400c0b10', 'leek vegetable stock white miso|have small  noves with a wine  stock and poach till soft'),
	('e0b91756-fb45-4947-a56c-a9c575d1f3f1', NULL, 'Tartar Salmn', '00:15:00', 1.00, '', NULL, '{"Cortar el salmn en dados muy pequeos (brunoise).","Picar finamente la cebolleta.","En un bol fro, mezclar el salmn, la cebolleta, la salsa de soja y el aceite de ssamo.","Remover con cuidado para no deshacer el pescado.","Mantener refrigerado hasta el momento de su uso."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', '81df22ac-c4f0-5484-8957-26420ed65365', 'aceite de ssamo cebolleta salmn salsa de soja|cortar el salmn en dados muy pequeos  brunoise  picar finamente la cebolleta  en un bol fro  mezclar el salmn  la cebolleta  la salsa de soja y el aceite de ssamo  remover con cuidado para no deshacer el pescado  mantener refrigerado hasta el momento de su uso'),
	('436e84a1-b015-4d80-8099-101f9a568a72', NULL, 'Cauliflower Mash', '00:15:00', 1.00, NULL, NULL, '{"Place cauliflower florets in a medium-sized saucepan, cover with water, and bring to a boil.","Let the florets boil until they are soft, about 15 minutes.","Drain the cauliflower and discard cooking water.","Return the cauliflower to the pot and add the other half of the olive oil and a sprinkle of salt.","Mash well until the cauliflower becomes almost like a puree."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', '0d2158cb-ccc8-5ac5-a7c7-b65d37c38671', 'cauliflower extra virgin olive oil sea salt|place cauliflower florets in a medium sized saucepan  cover with water  and bring to a boil  let the florets boil until they are soft  about   minutes  drain the cauliflower and discard cooking water  return the cauliflower to the pot and add the other half of the olive oil and a sprinkle of salt  mash well until the cauliflower becomes almost like a puree'),
