	('df188431-52e2-4c2a-bee9-501026c15dc3', NULL, 'Chocolate Ganache', '00:15:00', 1.00, NULL, NULL, '{"Warm up the cream to 90oC","Pour over the chocolate and allow to melt, mix with mariz","Emulsify with bamix without incorporating air and regrigerate"}', 'bdc44a77-6aaf-4039-bb52-d853fdff2364', NULL, 'Preparation', 'x', '5b6ce3e8-585b-5671-a566-dda9ef28e8f6', 'chocolate 55% whipping cream 35%|warm up the cream to  oc pour over the chocolate and allow to melt  mix with mariz emulsify with bamix without incorporating air and regrigerate'),
