	('4a006a6d-71c9-463f-a1b4-833cb347aa89', NULL, 'Salsa Mayo Ctrica', '00:05:00', 1.00, '', NULL, '{"En un bol, combinar la mayonesa, el zumo de lima y la ralladura de lima.","Mezclar bien hasta obtener una salsa homognea.","Reservar en fro."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', '38e25937-2a14-54ac-9693-419675d89a04', 'mayonesa ralladura de lima zumo de lima|en un bol  combinar la mayonesa  el zumo de lima y la ralladura de lima  mezclar bien hasta obtener una salsa homognea  reservar en fro'),
