	('439d0356-2e93-43b8-a828-16fe3be928ea', '9f88940c-3d5a-45f3-ae43-d72f7d7ddd19', 'Pollo ripieno arrosto', '01:00:00', 1.00, NULL, NULL, '{"Cominciate col dare alle salsicce e alle rigaglie mezza cottura nel burro.","Bagnandole con un po'' di brodo se occorre.","Conditele con poco sale e poco pepe a motivo delle corre.","Levate asciutte e nell''umido che resta gettate una midolla di pane.","Per ottenere con un po'' di brodo due cucchiaiate di papa soda.","Spellate le salsicce, tritate con cura."}', 'b81b76b5-b301-4c15-954c-c1e282bd1262', '2025-08-14 14:55:01.657618+00', 'Dish', 'x', '9dfee6c5-fdb9-5595-898f-68d177ac6b07', 'bread crumb broth butter chicken pepper salt stuffing mixture|cominciate col dare alle salsicce e alle rigaglie mezza cottura nel burro  bagnandole con un po  di brodo se occorre  conditele con poco sale e poco pepe a motivo delle corre  levate asciutte e nell umido che resta gettate una midolla di pane  per ottenere con un po  di brodo due cucchiaiate di papa soda  spellate le salsicce  tritate con cura'),
	('3d88351c-adf4-4a2f-8c35-5b45ba58ea16', '3ccf916d-636d-4648-8c27-b3bf21c04db1', 'Caneln de Pollo con Manzana', '00:35:00', 510.00, NULL, NULL, '{"Cocinar las lminas de canelones segn las instrucciones del paquete.","Rellenar los canelones con el Relleno de Pollo y Manzana.","Colocar los canelones rellenos en una bandeja para horno.","Cubrir generosamente con la salsa bechamel.","Espolvorear con queso para gratinar.","Gratinar en el horno precalentado a 200C hasta que est dorado.","Servir caliente."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Dish', 'g', 'feced875-fbda-5f01-a955-c99c835f3df5', 'bechamel pasta de canelones queso para gratinar relleno de pollo y manzana|cocinar las lminas de canelones segn las instrucciones del paquete  rellenar los canelones con el relleno de pollo y manzana  colocar los canelones rellenos en una bandeja para horno  cubrir generosamente con la salsa bechamel  espolvorear con queso para gratinar  gratinar en el horno precalentado a  c hasta que est dorado  servir caliente'),
	('d57f35df-406f-4ef8-9c9a-086d281e85dd', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Ceviche', '01:20:00', 300.00, NULL, NULL, '{"Fase uno: affettare le cipolle rosse e metterle in una ciotola.","Aggiungi il sale e il succo di lime e lasciali marinare mentre continui: questo aiuter a rimuovere l''amarezza dalle cipolle.","Fase due: tagliare il pesce in pezzi da 3/4 di pollice e mescolalo con le cipolle marinate.","Fase tre: aggiungere gli ingredienti rimanenti: cetriolo, pomodori e coriandolo (e l''avocado, se si usa subito) e dare un bel giro.","Se aggiungi l''avocado, attendi fino al servizio per aggiungerlo.","Fase quattro: lasciare marinare per 45-60 minuti.","Pi a lungo lasci che il pesce si indurisca nella marinata, pi ''cotto'' diventer."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'g', '6a01266c-bb17-5648-aca4-fa7b29c204b8', 'avocado cetriolo cipolle rosse coriandolo pesce bianco pomodori sale succo di lime|fase uno  affettare le cipolle rosse e metterle in una ciotola  aggiungi il sale e il succo di lime e lasciali marinare mentre continui  questo aiuter a rimuovere l amarezza dalle cipolle  fase due  tagliare il pesce in pezzi da   di pollice e mescolalo con le cipolle marinate  fase tre  aggiungere gli ingredienti rimanenti  cetriolo  pomodori e coriandolo  e l avocado  se si usa subito  e dare un bel giro  se aggiungi l avocado  attendi fino al servizio per aggiungerlo  fase quattro  lasciare marinare per   minuti  pi a lungo lasci che il pesce si indurisca nella marinata  pi  cotto  diventer'),
