	('c08c5906-306c-4847-b754-3a8c5d1b677f', NULL, 'Sofrito', '02:00:00', 550.00, '', NULL, '{"Sear the sausage and ribs in a wide pot.","Peel and finely chop the blood sausage.","Add the chopped blood sausage to the pot and saut for 5 minutes.","Add the minced garlic and saut for 30 seconds.","Add the Hida tomato.","Cook until the tomato has lost all its moisture and has a dark red color.","Add the red wine and let the alcohol evaporate.","Add water to cover the ingredients.","Cook over low heat, covered, for 90 minutes.","Uncover and let it reduce until almost no moisture remains."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Preparation', 'g', '02b33269-dd59-546d-a844-ad94fc00e97a', 'garlic hida tomato onion blood sausage pork ribs pork sausage red wine water|sear the sausage and ribs in a wide pot  peel and finely chop the blood sausage  add the chopped blood sausage to the pot and saut for   minutes  add the minced garlic and saut for   seconds  add the hida tomato  cook until the tomato has lost all its moisture and has a dark red color  add the red wine and let the alcohol evaporate  add water to cover the ingredients  cook over low heat  covered  for   minutes  uncover and let it reduce until almost no moisture remains'),
