	('0d16c807-a8eb-4cc6-ae5a-05f5660dbb45', NULL, 'Cauliflower Shepherd''s Pie', '00:50:00', 1.00, 'Vegan and Vegetarian: Use cooked lentils instead of ground meat.', NULL, '{"Preheat oven to 350F (177C).","Transfer the meat mixture to a casserole or pie dish and distribute into an even layer.","Top with the cauliflower mash and spread it evenly across the top.","Place in the oven and bake for 20 minutes.","Turn the oven to a low broil and broil for 10 minutes or until golden.","Remove from oven and serve."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-12-30 15:18:41.159258+00', 'Dish', 'x', '751cf2b6-130b-501b-a8c9-9cde636dd155', 'cauliflower mash turkey and vegetable mixture|preheat oven to  f  c  transfer the meat mixture to a casserole or pie dish and distribute into an even layer  top with the cauliflower mash and spread it evenly across the top  place in the oven and bake for   minutes  turn the oven to a low broil and broil for   minutes or until golden  remove from oven and serve'),
	('bd085868-82ee-4854-86fa-f168c11c02d7', '3ccf916d-636d-4648-8c27-b3bf21c04db1', 'Fideos a la Cazuela', '00:15:00', 200.00, NULL, NULL, '{"In a wide pot, add the noodles, the sofrito, and the black onion.","Saut until the noodles absorb some of the color from the sofrito.","Add the chicken stock.","Season with salt to taste, noting the stock should be slightly bland.","Cook for 10 minutes.","Cool quickly in a blast chiller."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Dish', 'g', 'a3c381f8-c577-5db4-aabc-355ad5a9b368', 'black onion chicken stock fideo noodles salt sofrito|in a wide pot  add the noodles  the sofrito  and the black onion  saut until the noodles absorb some of the color from the sofrito  add the chicken stock  season with salt to taste  noting the stock should be slightly bland  cook for   minutes  cool quickly in a blast chiller'),
	('0645184b-5b22-43e5-973e-8a48f20f3832', '3ccf916d-636d-4648-8c27-b3bf21c04db1', 'Base del Relleno', '00:30:00', 300.00, NULL, NULL, '{"Cortar la manzana en mirepoix irregular.","Sofrer la manzana hasta que se dore.","Pelar la morcilla y cortarla en brunoise muy fina.","Aadir la morcilla a la sartn.","Una vez tostada la morcilla, desglasar con el vino rancio.","Dejar que el alcohol se evapore.","Aadir las pasas y dejar que se hidraten a fuego suave.","Una vez hidratadas las pasas, reducir la mezcla a fuego lento.","Remover con cuidado para que no se queme hasta obtener una mezcla pastosa casi slida."}', 'd4fd22b5-b949-4b0f-a755-301d42fb3afb', NULL, 'Preparation', 'g', '71b54809-dbcd-5339-8e2a-00dab30976ae', 'manzana granny smith morcilla de cebolla uva pasa vino rancio|cortar la manzana en mirepoix irregular  sofrer la manzana hasta que se dore  pelar la morcilla y cortarla en brunoise muy fina  aadir la morcilla a la sartn  una vez tostada la morcilla  desglasar con el vino rancio  dejar que el alcohol se evapore  aadir las pasas y dejar que se hidraten a fuego suave  una vez hidratadas las pasas  reducir la mezcla a fuego lento  remover con cuidado para que no se queme hasta obtener una mezcla pastosa casi slida'),
	('022304ef-1962-4467-a153-c19bafaa22a0', NULL, 'Grilled Chicken with Wasabi Pepper Sauce', '00:25:00', 165.00, 'Do not overboil the Wasabi Pepper Sauce. If you overheat it, the pepperiness and aromatic qualities of the wasabi will disappear. Cook the chicken just until the skin is crisp, but the flesh is still plump and moist.', NULL, '{"Preheat a grill pan and a griddle.","Season the chicken breast and thigh with salt and pepper.","Brown the chicken in the grill pan.","Heat the chicken on the griddle until cooked through, about 12 minutes.","At the same time, cook the asparagus in boiling salted water until tender.","Drain the asparagus well.","Heat the clarified butter and grated garlic in a frying pan.","When you smell the garlic aroma, add the Wasabi Pepper Sauce and more black pepper to taste.","Immediately turn off the heat when the mixture comes to a boil.","Cut the broiled chicken into bite-size pieces.","Place the thigh meat on plates.","Place the breast meat on top of the thigh meat.","Pile finely shredded fresh wasabi on the top.","Pour over the Wasabi Pepper Sauce mix.","Finally add the cooked asparagus."}', 'cbbc6877-4a0e-4e99-aa87-a5cf51132629', NULL, 'Dish', 'g', '4c2b8015-fa44-5c73-80d0-8d4a49ca7cc5', 'anami black chicken breast anami black chicken thigh black pepper clarified butter fresh wasabi garlic green asparagus sea salt wasabi pepper sauce|preheat a grill pan and a griddle  season the chicken breast and thigh with salt and pepper  brown the chicken in the grill pan  heat the chicken on the griddle until cooked through  about   minutes  at the same time  cook the asparagus in boiling salted water until tender  drain the asparagus well  heat the clarified butter and grated garlic in a frying pan  when you smell the garlic aroma  add the wasabi pepper sauce and more black pepper to taste  immediately turn off the heat when the mixture comes to a boil  cut the broiled chicken into bite size pieces  place the thigh meat on plates  place the breast meat on top of the thigh meat  pile finely shredded fresh wasabi on the top  pour over the wasabi pepper sauce mix  finally add the cooked asparagus'),
