	('7fb47aaf-84c8-45b0-87f1-d6415b07c4b9', NULL, 'Holandesa', '00:15:00', 80.00, '', NULL, '{"En un bao mara, emulsionar la yema, el agua, el zumo de limn y la sal.","Una vez que la mezcla est espumosa, aadir la mantequilla clarificada poco a poco.","Continuar batiendo hasta alcanzar la textura deseada, sin superar los 64C."}', 'dd005247-66c4-44d9-af83-ed081c2cfe52', NULL, 'Preparation', 'ml', 'f08e3652-411e-5812-8d29-caa1eb21e7e4', 'agua huevo mantequilla clarificada sal zumo de limn|en un bao mara  emulsionar la yema  el agua  el zumo de limn y la sal  una vez que la mezcla est espumosa  aadir la mantequilla clarificada poco a poco  continuar batiendo hasta alcanzar la textura deseada  sin superar los  c'),
