	('f242ae6b-44f6-4b30-b108-1d9f64994022', NULL, 'Panco Tostado', '00:05:00', 90.00, '', NULL, '{"En una sartn seca a fuego medio, tostar el panco removiendo constantemente hasta que est dorado y crujiente."}', 'dd005247-66c4-44d9-af83-ed081c2cfe52', NULL, 'Preparation', 'g', 'd403d5b7-bed5-577a-a7fe-73987d68e186', 'panco|en una sartn seca a fuego medio  tostar el panco removiendo constantemente hasta que est dorado y crujiente'),
	('284e2b59-fede-446f-be31-15a172dc6733', NULL, 'Tempura Base', '00:05:00', 350.00, '', NULL, '{"Mezclar la harina y fcula con el agua helada y el huevo.","Remover ligeramente dejando grumos para no desarrollar el gluten.","Mantener muy fra hasta su uso."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '928aa1fa-f8ba-5e76-8772-8810894db2a5', 'agua helada fcula de maz harina de trigo huevo sal|mezclar la harina y fcula con el agua helada y el huevo  remover ligeramente dejando grumos para no desarrollar el gluten  mantener muy fra hasta su uso'),
	('4149c69c-7886-47b9-a87a-d95b0ea29297', '21e104b3-a875-40a7-b3d7-2221c2e9bb88', 'Arroz Para Sushi', '00:40:00', 1.00, NULL, NULL, '{"Lavar el arroz en agua fra hasta que el agua salga clara.","Escurrir bien y cocinar el arroz con los 240 ml de agua.","Mientras el arroz se cocina, calentar suavemente el vinagre de arroz con el azcar y la sal hasta que se disuelvan.","Una vez cocido el arroz, pasarlo a un bol grande no metlico.","Verter la mezcla de vinagre sobre el arroz caliente y mezclar con cuidado con una esptula, abanicando para enfriarlo.","Dejar reposar hasta que alcance la temperatura ambiente."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-12-01 10:47:53.775534+00', 'Preparation', 'x', '182e37c4-77c7-562f-bbe7-baa1fc499ee3', 'agua arroz para sushi azcar sal vinagre de arroz|lavar el arroz en agua fra hasta que el agua salga clara  escurrir bien y cocinar el arroz con los   ml de agua  mientras el arroz se cocina  calentar suavemente el vinagre de arroz con el azcar y la sal hasta que se disuelvan  una vez cocido el arroz  pasarlo a un bol grande no metlico  verter la mezcla de vinagre sobre el arroz caliente y mezclar con cuidado con una esptula  abanicando para enfriarlo  dejar reposar hasta que alcance la temperatura ambiente'),
	('3f124a52-de82-4397-a398-41f7e5eb0ee3', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Bastones de Queso Parmesano', '00:30:00', 20.00, NULL, NULL, '{"Estirar a 3 mm. de grueso , enfriar hasta casi congelar.","Cortar en bastones de 15 cm. de largo por 1 de ancho.","Pintar con yema de huevo rebajada con agua.","Cocer a 180C, 12 minutos."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', 'e1229ba4-6312-563a-bd2e-5e23e7627895', 'agua huevos masa de parmesano|estirar a   mm  de grueso   enfriar hasta casi congelar  cortar en bastones de   cm  de largo por   de ancho  pintar con yema de huevo rebajada con agua  cocer a  c    minutos'),
	('3cada16f-443b-4f05-8312-288487fd97c9', '28a20da3-d1f1-4ad5-9ba4-a504974e437f', 'Makomo-Dake with Creamy Spicy Sauce', '00:20:00', 150.00, NULL, NULL, '{"Heat vegetable oil for deep-frying to a temperature of 340F (170C).","Peel the makomo-dake and deep-fry for about 1 minute in the hot oil.","Preheat a broiler (grill).","Cut the fried makomo-dake in half lengthways.","Cover the rounded back part of the stalks with the minced shrimp and scallops.","Shape the mince mixture as you spoon it onto the makomo-dake.","Broil (grill) for about 2 minutes.","Spoon the Creamy Spicy Sauce and Yuzu Miso Sauce over the seafood mix.","Broil (grill) again until very lightly browned.","Serve on plates, together with the braised lotus root and the palate-cleansing yama momo."}', 'cbbc6877-4a0e-4e99-aa87-a5cf51132629', NULL, 'Dish', 'g', 'a9283e0a-c442-5929-90a1-e4b57cdd5a24', 'braised lotus root creamy spicy sauce makomo-dake shrimp and scallop mince vegetable oil yama momo yuzu miso sauce|heat vegetable oil for deep frying to a temperature of  f  c  peel the makomo dake and deep fry for about   minute in the hot oil  preheat a broiler  grill  cut the fried makomo dake in half lengthways  cover the rounded back part of the stalks with the minced shrimp and scallops  shape the mince mixture as you spoon it onto the makomo dake  broil  grill  for about   minutes  spoon the creamy spicy sauce and yuzu miso sauce over the seafood mix  broil  grill  again until very lightly browned  serve on plates  together with the braised lotus root and the palate cleansing yama momo'),
	('a47557e1-dcfe-4a32-b05c-ad0256a53691', NULL, 'Calamares rellenos', '00:30:00', 1.00, '', NULL, '{"Limpiar los calamares.","Pelar la butifarra y cortar en dados, calentarla para ablandar la gelatina que contiene.","Rellenar los calamares con la butifarra, envolver en papel film y enfriar sumergiendo en agua helada.","Una vez fro cortar rodajas de calamar y reservar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'x', '9db21b51-3214-5052-8a2c-0cc8081ade0a', 'butifarra de perol blanca calamares|limpiar los calamares  pelar la butifarra y cortar en dados  calentarla para ablandar la gelatina que contiene  rellenar los calamares con la butifarra  envolver en papel film y enfriar sumergiendo en agua helada  una vez fro cortar rodajas de calamar y reservar'),
	('dc3903bf-40f9-4f8e-abc2-685546712e44', '21e104b3-a875-40a7-b3d7-2221c2e9bb88', 'Gratin di Patate e Pancetta', '02:00:00', 350.00, NULL, NULL, '{"Scaldare il forno a 180C/160C ventola/gas 4.","Imburrare una teglia poco profonda (circa 20 x 30 cm).","Versare il latte e la panna in una grande casseruola, aggiungere l''aglio, raggiungere l''ebollizione.","Togliere dal fuoco per lasciare in infusione l''aglio e lasciare raffreddare un po''.","Scaldare l''olio in una padella e aggiungere il lardo/pancetta. Cuocere a fuoco medio-basso per 10 minuti fino a quando non diventano croccanti.","Rimuovere l''aglio dalla miscela di panna.","Usando un cucchiaio scanalato, inizia a stratificare le patate sulla base del piatto fino a coprire completamente.","Cucchiaio sopra un po'' della miscela di crema, un po'' di cheddar, parmigiano e groviera, e cospargere un po'' di pancetta.","Condire bene e ripetere fino a quando non hai esaurito tutte le patate.","Versare sopra la crema rimanente e cospargere con il formaggio rimanente. Metti da parte un po'' di pancetta per guarnire pi tardi.","Coprire con un foglio di alluminio e cuocere in forno per 1 ora.","Rimuovere la pellicola e cuocere per altri 30 minuti fino a quando le patate sono cotte (inserire uno spiedino o un coltello e controllare che non ci sia resistenza) e la guarnizione  dorata.","Cospargere con la pancetta rimanente per gli ultimi 5 minuti di cottura."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'g', '69c1c21a-abdb-54e2-9d47-8451803411ed', 'aglio burro doppia crema formaggio cheddar groviera latte parzialmente scremato olio vegetale pancetta affumicata parmigiano patate maris piper grandi|scaldare il forno a  c c ventola gas   imburrare una teglia poco profonda  circa   x   cm  versare il latte e la panna in una grande casseruola  aggiungere l aglio  raggiungere l ebollizione  togliere dal fuoco per lasciare in infusione l aglio e lasciare raffreddare un po  scaldare l olio in una padella e aggiungere il lardo pancetta  cuocere a fuoco medio basso per   minuti fino a quando non diventano croccanti  rimuovere l aglio dalla miscela di panna  usando un cucchiaio scanalato  inizia a stratificare le patate sulla base del piatto fino a coprire completamente  cucchiaio sopra un po  della miscela di crema  un po  di cheddar  parmigiano e groviera  e cospargere un po  di pancetta  condire bene e ripetere fino a quando non hai esaurito tutte le patate  versare sopra la crema rimanente e cospargere con il formaggio rimanente  metti da parte un po  di pancetta per guarnire pi tardi  coprire con un foglio di alluminio e cuocere in forno per   ora  rimuovere la pellicola e cuocere per altri   minuti fino a quando le patate sono cotte  inserire uno spiedino o un coltello e controllare che non ci sia resistenza  e la guarnizione  dorata  cospargere con la pancetta rimanente per gli ultimi   minuti di cottura'),
	('de54b1a5-880a-4bcf-a59f-996a05605f4b', '28a20da3-d1f1-4ad5-9ba4-a504974e437f', 'Tuna Sashimi Tempura Roll with Yuzu Miso Sauce', '00:25:00', 4.00, 'When frying the tuna roll, make sure that all the sides will be cooked evenly by rolling it with cooking chopsticks.', 'rounds', '{"Finely chop the tuna.","Wash the asparagus well and cook until just tender.","Drain the asparagus and refresh in iced water.","Place the nori on a bamboo rolling mat.","Spread the chopped tuna evenly over the nori, making it a little thicker on the side farthest from you.","Place the asparagus and thinly sliced scallion across the middle of the tuna.","Roll up the nori tightly.","Mix a small amount of flour with water to create a paste to seal the roll.","Heat the vegetable oil for deep-frying to 355F (180C).","Dust both ends of the rolled tuna with flour.","Deep-fry the roll for 30 seconds in the hot oil.","Drain the tuna roll on a paper towel.","Cut the roll across into 8 rounds.","Deep-fry the cherry tomato in the same oil until the skin crisps up.","Arrange the 8 tuna rolls in a circle.","Pour the Yuzu Miso Sauce into the middle of the circle.","Place the fried tomato in the center to serve."}', 'cbbc6877-4a0e-4e99-aa87-a5cf51132629', NULL, 'Dish', 'x', 'e85dd15a-b81e-5d52-aed4-eec5a935337c', 'cherry tomato flour green asparagus nori red meat tuna scallion vegetable oil yuzu miso sauce|finely chop the tuna  wash the asparagus well and cook until just tender  drain the asparagus and refresh in iced water  place the nori on a bamboo rolling mat  spread the chopped tuna evenly over the nori  making it a little thicker on the side farthest from you  place the asparagus and thinly sliced scallion across the middle of the tuna  roll up the nori tightly  mix a small amount of flour with water to create a paste to seal the roll  heat the vegetable oil for deep frying to  f  c  dust both ends of the rolled tuna with flour  deep fry the roll for   seconds in the hot oil  drain the tuna roll on a paper towel  cut the roll across into   rounds  deep fry the cherry tomato in the same oil until the skin crisps up  arrange the   tuna rolls in a circle  pour the yuzu miso sauce into the middle of the circle  place the fried tomato in the center to serve'),
	('de72faf3-5373-43d6-957f-219a0f681e44', NULL, 'Erbazzone Dough', '01:15:00', 925.00, '', NULL, '{"In a stand mixer fitted with the paddle attachment, combine both flours and the salt.","Add the cold butter cubes and beat until the texture of wet sand.","With the machine running, stream in the cold milk.","Remove the dough from the bowl and finish kneading by hand.","When homogenous, form a ball.","Wrap the dough in plastic wrap (cling film) and let rest in the fridge for at least 1 hour."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', 'b58a2b19-2cc5-58b5-91d1-6574bf205e26', 'milk salt tipo "00" flour unsalted butter whole wheat flour|in a stand mixer fitted with the paddle attachment  combine both flours and the salt  add the cold butter cubes and beat until the texture of wet sand  with the machine running  stream in the cold milk  remove the dough from the bowl and finish kneading by hand  when homogenous  form a ball  wrap the dough in plastic wrap  cling film  and let rest in the fridge for at least   hour'),
	('7d37bedd-91db-442e-a67e-e0daf49f22de', NULL, 'Salsa de Soja y Miel', '00:10:00', 40.00, '', NULL, '{"Caramelizar la miel.","Retirar del fuego y aadir la salsa de soja y el ssamo."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '95b43cfd-9716-5cca-9602-a062896b861f', 'miel salsa de soja ssamo tostado|caramelizar la miel  retirar del fuego y aadir la salsa de soja y el ssamo'),
	('da8686de-bf5e-4ea5-8d1e-cab6a3be6619', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Gazpacho de fresones', '00:10:00', 240.00, NULL, NULL, '{"Juntar todo, triturar y colar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'ml', '58c0f38b-a778-5670-bf9c-6bbbde9b3950', 'aceite de girasol agua fresones maduros sal vinagre de manzana|juntar todo  triturar y colar'),
	('fb353032-972f-4f5f-83e0-cf119683cadb', NULL, 'Muslos de Pichn Confitados', '04:00:00', 1.00, '', NULL, '{"Salpimentar los muslos y marinar con la mitad de las hierbas y las especias y 2 dientes de ajo durante 2 horas.","Retirar los ingredientes del marinado, blanquear, enfriar y secar.","Colocarlos en un recipiente con el aceite y el resto de hierbas, especias y los dientes de ajo restantes.","Confitar a 80 C hasta que estn tiernos."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'x', 'ef5458e6-5d71-51a4-bc72-fd89cecc58a6', 'aceite de girasol ajo laurel muslos de pichn pimienta negra en grano romero sal tomillo|salpimentar los muslos y marinar con la mitad de las hierbas y las especias y   dientes de ajo durante   horas  retirar los ingredientes del marinado  blanquear  enfriar y secar  colocarlos en un recipiente con el aceite y el resto de hierbas  especias y los dientes de ajo restantes  confitar a   c hasta que estn tiernos'),
	('df7571a0-15c1-46aa-a64d-ab6ca655c872', NULL, 'Espuma de Bechamel', '00:30:00', 500.00, '', NULL, '{"En un cazo a fuego suave, cocinar la harina con 30g de mantequilla para hacer un roux.","Asegurarse de que la masa quede lisa y cocida, pero sin tostar.","Aadir poco a poco la leche mezclada con la nata, sin dejar de remover para evitar grumos.","Prolongar la coccin hasta que la harina est completamente cocida.","Sazonar con sal y nuez moscada rallada.","Colar la mezcla.","Aadir los 30g restantes de mantequilla y emulsionar con un trmix.","Llenar un sifn de 1/2 litro con la bechamel.","Enroscar la cpsula de NO y agitar vigorosamente.","Retirar la cpsula y colocar el embellecedor.","Mantener el sifn caliente en un bao mara a 70C hasta su uso."}', 'dd005247-66c4-44d9-af83-ed081c2cfe52', NULL, 'Preparation', 'ml', '108afe00-3b7f-5c92-9fd9-7d57d26780ad', 'cpsula de no harina de trigo leche entera mantequilla nata lquida nuez moscada sal|en un cazo a fuego suave  cocinar la harina con  g de mantequilla para hacer un roux  asegurarse de que la masa quede lisa y cocida  pero sin tostar  aadir poco a poco la leche mezclada con la nata  sin dejar de remover para evitar grumos  prolongar la coccin hasta que la harina est completamente cocida  sazonar con sal y nuez moscada rallada  colar la mezcla  aadir los  g restantes de mantequilla y emulsionar con un trmix  llenar un sifn de   litro con la bechamel  enroscar la cpsula de n o y agitar vigorosamente  retirar la cpsula y colocar el embellecedor  mantener el sifn caliente en un bao mara a  c hasta su uso'),
	('1630bd90-6269-4aa4-8dce-a9820865c007', NULL, 'Salsa de pralin', '00:10:00', 70.00, '', NULL, '{"Juntar todo, calentar sin llegar a hervir, homogenizar.","Sazonar, mezclar con la nata, dejar a textura suave y reservar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'ml', 'a6f8e6fb-8acd-5bc8-9bf4-690de4ee0803', 'agua nata lquida pimienta blanca molida pralin sal|juntar todo  calentar sin llegar a hervir  homogenizar  sazonar  mezclar con la nata  dejar a textura suave y reservar'),
	('772c721f-d333-4f9c-8f72-07e1234c4cef', NULL, 'Masa de Coca', '00:45:00', 170.00, '', NULL, '{"Mezclar secos y aadir la levadura previamente disuelta y mezclada con el agua.","Amasar y dejar fermentar 20 minutos.","Extender 1 mm. de grueso y troquelar.","Pintar con aceite de oliva virgen extra.","Dejar fermentar en placas de horno.","Pinchar con un tenedor y cocer a 190 C 12 minutos aproximadamente.",Reservar.}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '7c0e8fed-cf0f-5556-8efe-b54f4f54ce42', 'aceite de oliva virgen extra agua harina de trigo levadura fresca sal ssamo|mezclar secos y aadir la levadura previamente disuelta y mezclada con el agua  amasar y dejar fermentar   minutos  extender   mm  de grueso y troquelar  pintar con aceite de oliva virgen extra  dejar fermentar en placas de horno  pinchar con un tenedor y cocer a   c   minutos aproximadamente  reservar'),
	('6577ce43-6f39-4a2e-9b6a-accf1216506a', NULL, 'Erbazzone Filling', '00:30:00', 540.00, '', NULL, '{"Clean the spinach and Swiss chard, removing tough stalks.","In a large pan, heat a drizzle of olive oil over low heat.","Add the garlic and sweat until it just goes translucent without coloring.","Increase the heat to medium-high and add the spinach and Swiss chard and cook until soft.","Season with salt and pepper.","Place in a colander to drain and cool.","One handful at a time, squeeze out the excess water using a cloth (cheesecloth/muslin is ideal).","Finely chop the cooked chard and spinach.","Place in a bowl and add the Parmigiano, Robiola, parsley, and basil.","Mix and transfer to a piping bag fitted with a 5/8-inch (1.5 cm) plain round tip.","Set aside."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '78a6061d-05fb-56d4-b4b5-818b2e5e5d7c', 'basil leaves black pepper garlic olive oil parmigiano-reggiano cheese parsley robiola cheese salt spinach swiss chard|clean the spinach and swiss chard  removing tough stalks  in a large pan  heat a drizzle of olive oil over low heat  add the garlic and sweat until it just goes translucent without coloring  increase the heat to medium high and add the spinach and swiss chard and cook until soft  season with salt and pepper  place in a colander to drain and cool  one handful at a time  squeeze out the excess water using a cloth  cheesecloth muslin is ideal  finely chop the cooked chard and spinach  place in a bowl and add the parmigiano  robiola  parsley  and basil  mix and transfer to a piping bag fitted with a  inch   cm  plain round tip  set aside'),
	('605288b6-74c4-4d39-95d2-a16c52258607', NULL, '', '00:30:00', 1.00, NULL, NULL, '{""}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'x', 'a992009a-5321-568c-8fb0-c8f939c0da95', 'aceite de oliva virgen extra masa de coca queso mahn curado en virutas sobrasada en trocitos tremp|'),
	('e3882b8c-2aab-4fe0-90b5-ea842a15db27', NULL, 'Papada de Cerdo Cocida', '01:30:00', 150.00, '', NULL, '{"Salar la papada, blanquearla, lavarla y escurrirla.","Ponerla a cocer con agua abundante, aadir las hierbas y especias.","Una vez cocida dejar dentro de su propio jugo de coccin.","Enfriar y cortar en dados de 2 x 2 cm. aproximadamente, procurando que todos tengan piel."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '145940bf-4111-55ef-9f49-246846af84e0', 'agua cebolla clavo de olor laurel papada de cerdo sal tomillo|salar la papada  blanquearla  lavarla y escurrirla  ponerla a cocer con agua abundante  aadir las hierbas y especias  una vez cocida dejar dentro de su propio jugo de coccin  enfriar y cortar en dados de   x   cm  aproximadamente  procurando que todos tengan piel'),
	('54cc324d-3ef6-4306-b42f-5e9c012f2f4b', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Tempura de Frutos Secos', '00:20:00', 350.00, NULL, NULL, '{"Pasar los frutos y semillas por harina de arroz.","Pasarlos por la tempura muy ligera.","Frer en aceite de oliva a 180C.","Decantar el aceite.","Sazonar con la garriguette, las especias y la sal."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', '6cc15858-01db-5121-bf56-3081dd0b7b62', 'aceite de oliva cuatro especias curry frutos secos y semillas variados garriguette harina de arroz pimentn dulce sal tempura base|pasar los frutos y semillas por harina de arroz  pasarlos por la tempura muy ligera  frer en aceite de oliva a  c  decantar el aceite  sazonar con la garriguette  las especias y la sal'),
	('b9bedd36-0a97-4a2c-820a-9080a4c13d00', NULL, 'Masa de Parmesano', '01:00:00', 670.00, '', NULL, '{"Amasar la harina con la sal y el agua.","Enfriar la masa en la nevera 30 min.","Extender la mantequilla entre dos hojas de papel sulfurizado en cuadrado y reservar en nevera.","Extender la masa fra (pastn) en cuadrado, poner la mantequilla en el centro, envolverla con la masa y estirar en un rectngulo.","Dar un pliegue doble (dividir la masa en 4 y doblarla).","Reposar en nevera.","Repetir el mismo procedimiento y enfriar.","Estirar y aadir el parmesano rallado, acabar con un pliegue sencillo, (dividir la masa en 3 y doblarla)."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '80373604-c2ec-5461-9cd8-5708af54354e', 'agua harina mantequilla queso parmesano rallado sal|amasar la harina con la sal y el agua  enfriar la masa en la nevera   min  extender la mantequilla entre dos hojas de papel sulfurizado en cuadrado y reservar en nevera  extender la masa fra  pastn  en cuadrado  poner la mantequilla en el centro  envolverla con la masa y estirar en un rectngulo  dar un pliegue doble  dividir la masa en   y doblarla  reposar en nevera  repetir el mismo procedimiento y enfriar  estirar y aadir el parmesano rallado  acabar con un pliegue sencillo   dividir la masa en   y doblarla'),
	('b032771d-73ec-4106-9436-05a3228974b9', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Calamares con butifarra de perol y salsa de pralin', '00:15:00', 150.00, NULL, NULL, '{"Asar, en una sartn caliente, la rodaja de calamar hasta dejar bien dorada la superficie de butifarra del relleno.","Saltear los tentculos, salpimentar.","Servir acompaado de la salsa de pralin."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', '128665b5-6db2-5aaa-a213-f64c5531c76c', 'calamares rellenos pimienta blanca sal salsa de pralin|asar  en una sartn caliente  la rodaja de calamar hasta dejar bien dorada la superficie de butifarra del relleno  saltear los tentculos  salpimentar  servir acompaado de la salsa de pralin'),
	('ba462224-d3f6-4d91-922a-327a53207132', NULL, 'Roasted Butternut Squash Soup', '00:40:00', 250.00, 'Save all leftover peels and trimmings from the carrots, onion, and garlic for later use.', NULL, '{"Preheat the oven to 200C (392F).","Cut the butternut squash in half lengthwise, remove the seeds (set them aside for later), and roast skin side down.","Peel and chop carrots, onion, and garlic.","Drizzle olive oil, season with salt and pepper, and roast veggies for 45-50 minutes.","Dice a portion of roasted butternut squash for Butternut Squash Risotto & save for recipe 7.","Roast leftover butternut squash seeds for 10-15 minutes.","Blend roasted vegetables until smooth, adjusting consistency with broth or water.","Heat soup in a pot, season to taste, and serve hot with roasted seeds and olive oil garnish."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-12-30 15:18:04.811881+00', 'Dish', 'ml', 'de3f7adf-852e-523a-ba3e-2574f9478c93', 'butternut squash carrots garlic olive oil onion pepper salt|preheat the oven to  c  f  cut the butternut squash in half lengthwise  remove the seeds  set them aside for later  and roast skin side down  peel and chop carrots  onion  and garlic  drizzle olive oil  season with salt and pepper  and roast veggies for   minutes  dice a portion of roasted butternut squash for butternut squash risotto   save for recipe   roast leftover butternut squash seeds for   minutes  blend roasted vegetables until smooth  adjusting consistency with broth or water  heat soup in a pot  season to taste  and serve hot with roasted seeds and olive oil garnish'),
	('cafe80e6-10c6-47f4-80d0-7b22b45194ce', NULL, 'Spicy Barbecue Wing Sauce', '00:05:00', 260.00, '', NULL, '{"In a small bowl, mix barbecue sauce, red pepper sauce, Cajun seasoning and cumin until well combined."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'ml', '6a035f46-4aa7-562c-bb65-feb8ce1772db', 'barbecue sauce cajun seasoning ground cumin red pepper sauce|in a small bowl  mix barbecue sauce  red pepper sauce  cajun seasoning and cumin until well combined'),
	('19782d1f-ca32-4746-baa5-28490f5378d0', 'c6d05fbc-03b1-463b-bc8b-7ef5284179d4', 'Erbazzone', '01:30:00', 6.00, 'These individual-size mini pies are addictive and easy to wrap up and carry.', 'Pezzo', '{"Lightly grease twelve 2 1/2-inch (6 cm) ring molds with butter or oil.","On a lightly floured surface, roll out the dough to a thickness of about 1/8 inch (3 mm).","Using a cookie cutter, cut the dough into twelve 4 3/4-inch (12 cm) rounds and press into the ring molds creating a small pie shape.","Pipe in the Swiss chard and spinach mixture (filling), leaving a well in the center.","Fill the well with about scant 2 teaspoons Robiola cheese.","In a small bowl, whisk the egg white, then brush the rim of the pie shells with the egg.","Using a cookie cutter, cut out twelve 2 3/4-inch (7 cm) rounds from the remaining dough.","Brush the 2 3/4-inch (7 cm) rounds with whisked egg white and place them egg-white-side down on top of the spinach filling.","Press around the edges with a rolling pin or fork to seal the edges.","Cut out small holes (in any desired shape) in the top crust to let the steam escape.","Line a sheet pan with parchment (baking) paper, set all the pies on the lined pan, and transfer to the fridge to rest for at least 1 hour.","Preheat the oven to 450F (230C/Gas Mark 8).","Bake until the crust is cooked through and golden brown, about 12 minutes.","Remove from the oven and let cool on a wire rack.","When cooled, remove from the ring molds by lightly running a small knife around the edges of the pan."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'x', '2e571ca1-87ef-5113-add7-c9a0965f9f4c', 'butter egg erbazzone dough erbazzone filling flour robiola cheese|lightly grease twelve    inch   cm  ring molds with butter or oil  on a lightly floured surface  roll out the dough to a thickness of about   inch   mm  using a cookie cutter  cut the dough into twelve    inch   cm  rounds and press into the ring molds creating a small pie shape  pipe in the swiss chard and spinach mixture  filling  leaving a well in the center  fill the well with about scant   teaspoons robiola cheese  in a small bowl  whisk the egg white  then brush the rim of the pie shells with the egg  using a cookie cutter  cut out twelve    inch   cm  rounds from the remaining dough  brush the    inch   cm  rounds with whisked egg white and place them egg white side down on top of the spinach filling  press around the edges with a rolling pin or fork to seal the edges  cut out small holes  in any desired shape  in the top crust to let the steam escape  line a sheet pan with parchment  baking  paper  set all the pies on the lined pan  and transfer to the fridge to rest for at least   hour  preheat the oven to  f  c gas mark   bake until the crust is cooked through and golden brown  about   minutes  remove from the oven and let cool on a wire rack  when cooled  remove from the ring molds by lightly running a small knife around the edges of the pan'),
	('8b92677a-1dc7-4503-8490-fdd72610b6c9', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'ARROCES inflados', '04:00:00', 100.00, 'El arroz salvaje no necesita coccin previa para inflarse.', NULL, '{"Cocer en agua y sal por separado todos los arroces excepto el salvaje que no hace falta cocerlo para crear el efecto inflado.","Cocer hasta pasarlos de coccin pero sin que los granos de desahagan.","Lavar con agua fra y extender en bandejas de horno con papel sulfurizado.","Secar en horno ventilado a 70C, (tambin se puede secar a temperatura ambiente).","Mover de vez en cuando para favorecer que queden los granos sueltos.","Frer en aceite de girasol a 190C unos segundos, lo suficiente para que se inflen pero no se tuesten.","Decantar sobre papel absorbente y sazonar con diversas hierbas aromticas y especias."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', 'c89f7b2b-64bf-558a-98d7-f6be63b679b7', 'aceite de girasol arroces variados (bomba, salvaje, basmati, integral rojo) especias (garryguette, pimentn dulce, curry, cuatro especias) hierbas aromticas sal|cocer en agua y sal por separado todos los arroces excepto el salvaje que no hace falta cocerlo para crear el efecto inflado  cocer hasta pasarlos de coccin pero sin que los granos de desahagan  lavar con agua fra y extender en bandejas de horno con papel sulfurizado  secar en horno ventilado a  c   tambin se puede secar a temperatura ambiente  mover de vez en cuando para favorecer que queden los granos sueltos  frer en aceite de girasol a  c unos segundos  lo suficiente para que se inflen pero no se tuesten  decantar sobre papel absorbente y sazonar con diversas hierbas aromticas y especias'),
