	('1e9661c9-a700-4757-afb7-0baf6483aaf1', NULL, 'Tremp', '00:20:00', 170.00, '', NULL, '{"Saltear los dos pimientos en el aceite de oliva.","Cuando empiecen a estar un poco tiernos, aadir el ajo y la cebolla tierna, saltear.","Aadir el tomate, cocer a fuego fuerte para evaporar el agua de vegetacin.","Cuando empiece a estar seco, aadir las aceitunas, las hierbas, retirar del fuego y rectificar.","Debe quedar ligeramente cido y las hortalizas al dente."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', 'c6b31acd-7288-52b9-a4fc-3ced29956d81', 'aceite de oliva aceite de oliva virgen extra aceitunas negras deshuesadas ajo cisel cebolla tierna en eminc hinojo organo pimiento rojo a dados pimiento verde a dados tomate pelado y en dados|saltear los dos pimientos en el aceite de oliva  cuando empiecen a estar un poco tiernos  aadir el ajo y la cebolla tierna  saltear  aadir el tomate  cocer a fuego fuerte para evaporar el agua de vegetacin  cuando empiece a estar seco  aadir las aceitunas  las hierbas  retirar del fuego y rectificar  debe quedar ligeramente cido y las hortalizas al dente'),
	('bf5bf581-888e-4216-ad3d-ab024b8e352c', '21e104b3-a875-40a7-b3d7-2221c2e9bb88', 'Buffalo Chicken Wings', '00:55:00', 24.00, 'Carrot and zucchini sticks are also tasty served with the celery, wings and dressing.', 'wings', '{"Cut each chicken wing at joints to make 3 pieces; discard tip.","Cut off and discard excess skin.","Heat oven to 425F.","In 13x9-inch pan, melt butter in oven.","In large resealable food-storage plastic bag, mix flour, salt and pepper.","Add chicken; seal bag and shake until chicken is completely coated with flour mixture.","Place in pan.","Bake uncovered 20 minutes; turn chicken.","In small bowl, mix barbecue sauce, pepper sauce, Cajun seasoning and cumin.","Pour over chicken; toss until evenly coated with sauce.","Bake uncovered 10 to 12 minutes longer or until chicken is no longer pink in center.","Serve chicken wings with celery and dressing."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2026-01-07 18:46:10.911282+00', 'Dish', 'x', '5e4a08a1-9f4d-5ece-8b33-5b4cf12d68ea', 'blue cheese dressing butter carrots celery chicken wings seasoned flour coating spicy barbecue wing sauce zucchini|cut each chicken wing at joints to make   pieces  discard tip  cut off and discard excess skin  heat oven to  f  in  x inch pan  melt butter in oven  in large resealable food storage plastic bag  mix flour  salt and pepper  add chicken  seal bag and shake until chicken is completely coated with flour mixture  place in pan  bake uncovered   minutes  turn chicken  in small bowl  mix barbecue sauce  pepper sauce  cajun seasoning and cumin  pour over chicken  toss until evenly coated with sauce  bake uncovered   to   minutes longer or until chicken is no longer pink in center  serve chicken wings with celery and dressing'),
	('df7ada4e-acf8-4a32-a168-e66cbc816a97', NULL, 'Grapefruit Foam', '12:20:00', 519.00, '', NULL, '{"In a bowl of cold water, hydrate the gelatin leaf.","In a pot, combine the sugar and 3 1/2 tablespoons (50 ml) water and bring to a boil.","Let cool back down to about 122F (50C).","Squeeze the excess water out of the gelatin leaf and add to the pot.","Pour the syrup over the grapefruit juice and blend using a hand blender.","Add the powdered egg whites and continue to blend until everything has dissolved.","Place the mixture in a 1-quart (1-liter) canister of a whipper siphon and charge with two N2O siphon charges.","Let rest in the fridge overnight."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '827cd73d-cddc-5e1a-8785-a63464b889c0', 'freshly squeezed grapefruit juice gelatin leaf granulated sugar n2o siphon charges powdered egg whites water|in a bowl of cold water  hydrate the gelatin leaf  in a pot  combine the sugar and     tablespoons   ml  water and bring to a boil  let cool back down to about  f  c  squeeze the excess water out of the gelatin leaf and add to the pot  pour the syrup over the grapefruit juice and blend using a hand blender  add the powdered egg whites and continue to blend until everything has dissolved  place the mixture in a  quart  liter  canister of a whipper siphon and charge with two n o siphon charges  let rest in the fridge overnight'),
	('fb1f94bf-d79a-4b62-9ec6-9c6c177b073f', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Grisines de semillas de amapola y pipas', '03:30:00', 15.00, 'Yield estimated based on ~400g total dough divided into 15g portions.', NULL, '{"Mezclar todos los ingredientes excepto la sal y amasar durante unos minutos hasta obtener una masa lisa y elstica, aadir la sal.","Dejar fermentar 2 horas, romper la fermentacin y hacer pequeas porciones de 15 g aproximadamente.","Dejar fermentar de nuevo 10 minutos, dar forma de grisines y colocar en bandeja de horno.","Pintar con un poco de agua y espolvorear por encima las semillas o frutos secos.","Fermentar otra vez 1 hora y cocer a 210C, entre 8-10 minutos."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', '863af3a6-a6b4-5b3d-a2b0-b0d4d1c44b18', 'aceite de oliva agua azcar harina de trigo levadura sal semillas y frutos secos|mezclar todos los ingredientes excepto la sal y amasar durante unos minutos hasta obtener una masa lisa y elstica  aadir la sal  dejar fermentar   horas  romper la fermentacin y hacer pequeas porciones de   g aproximadamente  dejar fermentar de nuevo   minutos  dar forma de grisines y colocar en bandeja de horno  pintar con un poco de agua y espolvorear por encima las semillas o frutos secos  fermentar otra vez   hora y cocer a  c  entre   minutos'),
	('9852b50c-8a77-4447-97bf-1dc5ba5844cb', NULL, 'Gnocco Fritto Dough', '14:20:00', 929.00, '', NULL, '{"In a stand mixer fitted with the paddle attachment, stir together the yeast, sparkling water, cream, and olive oil.","Add the flour slowly and mix until the dough just starts to come together. It won''t be smooth at this point.","Add the salt at the end and let mix for another minute.","Wrap the broken dough in plastic wrap (cling film) or in a bag and let sit in the fridge for at least 2 hours.","Remove the dough from the fridge.","If using a pasta machine, take about a quarter of the dough and flatten it out with a rolling pin, then pass it through the thickest setting.","Reduce the setting and roll again; continue until the dough is about 3/8 inch (1 cm) thick.","Fold the dough over itself in 3 (like a pamphlet) and start the process again. Do this a total of 4 times.","If working by hand, roll on a lightly floured surface to 3/8 inch (1 cm), fold in 3, and repeat 4 times.","Wrap again and place in the fridge for another 12 hours."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '83f69346-661a-5348-8476-91820a61d3d2', 'brewer''s or active dry yeast heavy cream olive oil salt sparkling water tipo "00" flour|in a stand mixer fitted with the paddle attachment  stir together the yeast  sparkling water  cream  and olive oil  add the flour slowly and mix until the dough just starts to come together  it won t be smooth at this point  add the salt at the end and let mix for another minute  wrap the broken dough in plastic wrap  cling film  or in a bag and let sit in the fridge for at least   hours  remove the dough from the fridge  if using a pasta machine  take about a quarter of the dough and flatten it out with a rolling pin  then pass it through the thickest setting  reduce the setting and roll again  continue until the dough is about   inch   cm  thick  fold the dough over itself in    like a pamphlet  and start the process again  do this a total of   times  if working by hand  roll on a lightly floured surface to   inch   cm  fold in   and repeat   times  wrap again and place in the fridge for another   hours'),
	('dab56277-e146-406e-913e-2ccaa962fe12', 'c6d05fbc-03b1-463b-bc8b-7ef5284179d4', 'Gnocco Fritto', '00:30:00', 180.00, 'Gnocco fritto is served soft, not crispy. Yields about 16 squares total.', NULL, '{"Roll out the chilled dough and redo the fold once again.","Roll the dough out to 1/8 inch (3 mm) thick.","Cut the dough into 3-inch (8 cm) squares.","Pour 4 inches (10 cm) vegetable oil into a deep heavy-bottom saucepan and heat to 356F (180C).","Line a sheet pan with paper towels.","Working in batches, add the dough squares to the hot oil.","Fry until they puff and the corners are slightly golden, carefully flipping each gnocco.","Let the second side get ever so slightly golden. Do not overfry; the bread is served soft, not crispy.","When lightly golden, transfer to the lined pan to drain.","For each serving, place 2 gnocchi on a plate.","Top each gnocco with a slice of mortadella, a spoonful of ricotta, and a drizzle of balsamic vinegar."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'g', 'c30f382c-1858-5a5d-af14-9eeabc7eda25', 'extra-aged balsamic vinegar fresh ricotta cheese gnocco fritto dough mortadella vegetable oil|roll out the chilled dough and redo the fold once again  roll the dough out to   inch   mm  thick  cut the dough into  inch   cm  squares  pour   inches   cm  vegetable oil into a deep heavy bottom saucepan and heat to  f  c  line a sheet pan with paper towels  working in batches  add the dough squares to the hot oil  fry until they puff and the corners are slightly golden  carefully flipping each gnocco  let the second side get ever so slightly golden  do not overfry  the bread is served soft  not crispy  when lightly golden  transfer to the lined pan to drain  for each serving  place   gnocchi on a plate  top each gnocco with a slice of mortadella  a spoonful of ricotta  and a drizzle of balsamic vinegar'),
	('a1538e48-61a8-4f3d-be9a-465c9b1e2d15', NULL, 'Tartaleta de Butifarra y Pur', '00:10:00', 1.00, NULL, 'tartaleta', '{"Calentar la butifarra en horno, gratinador o sartn.","Rellenar las tartaletas con el pur caliente.","Colocar encima de cada tartaleta una rodaja de butifarra.","Por ltimo los piones."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'x', '03e0c606-ce74-5590-86b9-df1c7c9e5755', 'butifarra negra masa de tartaleta piones tostados pur de patata kennebec|calentar la butifarra en horno  gratinador o sartn  rellenar las tartaletas con el pur caliente  colocar encima de cada tartaleta una rodaja de butifarra  por ltimo los piones'),
	('3109e3e6-add2-4ea0-ab3c-8c57b34c6a43', NULL, 'Marinada de Caza', '00:05:00', 200.00, '', NULL, '{"Preparar una marinada mezclando el vino tinto con las hierbas aromticas, la pimienta, las bayas de enebro y el ajo."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'ml', '037b8bf0-6711-5e60-a66c-65903234c819', 'ajo enebro pimienta romero tomillo vino tinto|preparar una marinada mezclando el vino tinto con las hierbas aromticas  la pimienta  las bayas de enebro y el ajo'),
	('da4220c2-b104-41ca-ab47-fbc0ab4a1901', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Pur de Berenjenas y Arenque Ahumado con Fritura de Pescadito', '00:20:00', 250.00, 'El pescado debe estar bien dorado y crujiente. Servir inmediatamente.', NULL, '{"Calentar el aceite de oliva a 190C.","Harinar el pescado justo antes de frer y sacudir el exceso de harina.","Una vez dorado, retirarlo con la espumadera, ponerlo sobre papel absorbente y salar.","Servir acompaado del pur de berenjena y de las huevas ahumadas."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', '8801289a-a225-5202-9c94-ef76ef6a8306', 'aceite de oliva harina de frer huevas de arenque ahumado pescadito de playa pur de berenjena|calentar el aceite de oliva a  c  harinar el pescado justo antes de frer y sacudir el exceso de harina  una vez dorado  retirarlo con la espumadera  ponerlo sobre papel absorbente y salar  servir acompaado del pur de berenjena y de las huevas ahumadas'),
	('5aec4995-6f25-4aec-87d3-318ae2e7ab05', NULL, 'Candied Grapefruit Peel', '00:45:00', 250.00, '', NULL, '{"Cut the reserved grapefruit peel into scant 1/4-inch (5 mm) dice.","Place the dice in a pot and cover with cold water. Bring to a boil and as soon as it boils, strain the blanched peel and discard the water.","In a saucepan, combine 8 1/2 tablespoons (125 ml) water, the sugar, and salt and bring to a boil.","Add the blanched grapefruit peel and boil for 1 minute.","Let cool to room temperature before storing in the fridge for up to 3 months."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', 'cae04293-211a-5b63-9d9d-2e5f2354689f', 'granulated sugar grapefruit salt water|cut the reserved grapefruit peel into scant  inch   mm  dice  place the dice in a pot and cover with cold water  bring to a boil and as soon as it boils  strain the blanched peel and discard the water  in a saucepan  combine     tablespoons   ml  water  the sugar  and salt and bring to a boil  add the blanched grapefruit peel and boil for   minute  let cool to room temperature before storing in the fridge for up to   months'),
	('d1969676-94e5-4f60-a2ce-fb008b3f6379', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Hay-Smoked Ice Cream', '24:20:00', 400.00, '', NULL, '{"Preheat an offset smoker to no higher than 140F (60C).","In a saucepan, whisk together the cream, milk, egg yolks, sugar, and salt and warm over medium heat, stirring constantly, until it reaches 176F (80C).","Pour into a shallow tray and place the tray in the smoker.","Add the dried alfalfa hay to the firebox and let smoke for 20 minutes.","Pour into a storage container and let rest in the fridge for 24 hours.","Pour the chilled mixture into an ice cream maker and freeze according to the manufacturer''s directions."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '2ac520fb-22e8-5f84-bca6-e0bebd44ff90', 'dried alfalfa hay egg granulated sugar heavy cream salt whole milk|preheat an offset smoker to no higher than  f  c  in a saucepan  whisk together the cream  milk  egg yolks  sugar  and salt and warm over medium heat  stirring constantly  until it reaches  f  c  pour into a shallow tray and place the tray in the smoker  add the dried alfalfa hay to the firebox and let smoke for   minutes  pour into a storage container and let rest in the fridge for   hours  pour the chilled mixture into an ice cream maker and freeze according to the manufacturer s directions'),
	('dbcacc77-06df-44b9-9d42-f3c2df0a01a1', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Amarena Cherry Sorbet', '00:45:00', 330.00, '', NULL, '{"In a blender, combine the cherries, sugar, and lemon juice and blend until smooth.","Transfer to a Pacojet beaker and freeze; when ready to serve, spin up the sorbet.","(Alternatively, freeze in an ice cream maker according to the manufacturer''s directions.)"}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '8a9a001c-03df-59c1-9871-f6001b0a048e', 'granulated sugar|in a blender  combine the cherries  sugar  and lemon juice and blend until smooth  transfer to a pacojet beaker and freeze  when ready to serve  spin up the sorbet   alternatively  freeze in an ice cream maker according to the manufacturer s directions'),
	('05840708-09b3-43a6-948f-067b5b050c4d', NULL, 'Traditional Sbrisolona (Pie Form)', '01:35:00', 1.00, NULL, 'wedge', '{"Coarsely chop the toasted almonds.","In a stand mixer fitted with the whisk attachment, cream the butter and sugar at high speed.","In a separate bowl, stir together the almonds, tipo \"00\" flour, cornmeal, and salt.","In another bowl, mix together the egg and grappa.","Once the butter is creamed, add half the egg mixture, and mix until fully incorporated, then repeat with the remaining egg mixture.","Replace the whisk with the paddle attachment and at the lowest speed start adding the dry ingredients. You do not want this dough to become homogenousin fact, you absolutely want to create a chunky dough. Make sure the chunks are no bigger than  inch (1 cm).","Cover the bowl with plastic wrap (cling film) and refrigerate for at least 1 hour.","Preheat the oven to 325F (160C/Gas Mark 3).","Grease two 10-inch (25 cm) pie pans with butter or oil.","Pat the dough into the two pans, roughly -inch (1 cm) high.","Bake for 1520 minutes, or until golden brown.","To serve, let cool to room temperature, remove from the pie pan, and cut into wedges."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'x', 'bbb0fe91-2fe1-5fc9-90e4-86d161e7f1a3', 'butter or oil cornmeal egg granulated sugar grappa salt tipo "00" flour toasted almonds unsalted butter|coarsely chop the toasted almonds  in a stand mixer fitted with the whisk attachment  cream the butter and sugar at high speed  in a separate bowl  stir together the almonds  tipo   flour  cornmeal  and salt  in another bowl  mix together the egg and grappa  once the butter is creamed  add half the egg mixture  and mix until fully incorporated  then repeat with the remaining egg mixture  replace the whisk with the paddle attachment and at the lowest speed start adding the dry ingredients  you do not want this dough to become homogenous in fact  you absolutely want to create a chunky dough  make sure the chunks are no bigger than   inch   cm  cover the bowl with plastic wrap  cling film  and refrigerate for at least   hour  preheat the oven to  f  c gas mark   grease two  inch   cm  pie pans with butter or oil  pat the dough into the two pans  roughly  inch   cm  high  bake for   minutes  or until golden brown  to serve  let cool to room temperature  remove from the pie pan  and cut into wedges'),
	('cf6fac9a-7b24-4750-b21f-d008be84fc3c', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Liebre a la Royal al Perfume de Chartreuse', '36:00:00', 350.00, NULL, NULL, '{"Preparar la liebre, despojar de su piel y sus interiores recuperando el corazn, el hgado y la sangre.","Cortar la cabeza.","Deshuesar al completo evitando todo agujero.","Colocar la liebre en una bandeja y verter todos los ingredientes de la marinada.","Reservar durante 12h en la nevera.","Estirar sobre la mesa el redao que habremos limpiado con agua durante varias horas.","Dar forma rectangular y disponer la liebre deshuesada.","Colocar el relleno y el foie gras.","Enrollar la liebre con la ayuda del redao y dar forma cilndrica.","Atar una primera vez, envolver ahora con un pao blanco y atar de nuevo.","En una bandeja de horno con aceite de oliva colorear los huesos, la verdura y desglasar con la mantequilla y el vino tinto de la marinada.","Aadir los cilindros de liebre.","Cocer en el horno a una temperatura de 90C durante 10 horas.","Una vez el tiempo transcurrido y hecho enfriar dentro, al da siguiente retiramos la liebre de su envoltorio y filmar firmemente.",Reservar.,"Al da siguiente envasar al vaco y dejar reposar 12 horas.","Recuperar el jugo de coccin, desgrasar y hacer reducir a la mitad.","Para emplatar, utilizar el chocolate, la trufa negra, vinagre, flor de sal y jugo de carne segn la seccin Diversos."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'g', 'a9dff267-f78a-50df-846b-52302b533244', 'aceite de oliva aceite de trufa agar agar celeri/trufa armaac chartreuse chocolate negro flor de sal foie gras confitado hoja de oro jugo de carne jugo de trufa liebre entero con piel marinada para liebre pimienta negra pimienta negra en grano redao de cerdo relleno para liebre tomillo fresco trufa negra vene cress vinagre de jerez|preparar la liebre  despojar de su piel y sus interiores recuperando el corazn  el hgado y la sangre  cortar la cabeza  deshuesar al completo evitando todo agujero 