	('31be0e81-74dd-4484-9c8c-c6fdb73c3706', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Masa de Tartaleta', '00:45:00', 1.00, '', NULL, '{"Mezclar secos, arenar con mantequilla y ligar con agua.","Estufar 15 minutos y estirar 1 mm de grosor.","Troquelar discos del dimetro adecuado al molde.","Reposar en nevera.","Cocer a 180C en el horno ventilado, unos 15 minutos."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'x', 'b9f615d7-ad95-59d3-bda8-c00cfde66410', 'agua harina mantequilla sal|mezclar secos  arenar con mantequilla y ligar con agua  estufar   minutos y estirar   mm de grosor  troquelar discos del dimetro adecuado al molde  reposar en nevera  cocer a  c en el horno ventilado  unos   minutos'),
	('0213f070-678d-4edb-9e40-bcdf8cb37d62', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Pur de Berenjena', '01:00:00', 200.00, '', NULL, '{"Asar la berenjena sobre brasas o en un horno a 250C dejndola muy cocida.","Una vez fra, pelar y dejar escurrir el agua de vegetacin.","Picar la berenjena.","Mezclar con el resto de ingredientes.","Dejar reposar.","Finalmente retirar el ajo."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', 'e1da66a2-2c1e-56d4-b22d-b6329feaf88e', 'aceite de oliva ajo berenjena mediana comino molido filete de anchoa limpio perejil picado pimienta blanca molida sal zumo de limn|asar la berenjena sobre brasas o en un horno a  c dejndola muy cocida  una vez fra  pelar y dejar escurrir el agua de vegetacin  picar la berenjena  mezclar con el resto de ingredientes  dejar reposar  finalmente retirar el ajo'),
	('cbe2b0a2-8f03-4f0b-bc47-f6a3589d8242', NULL, 'Grapefruit Sorbet', '12:30:00', 850.00, '', NULL, '{"Set aside the peels from 2 of the grapefruit (for the candied peel) and add the remaining peels (from 8 grapefruit) to the juice.","Using a strong hand blender, break apart the skins into the juice mixture.","Cover and let the bitterness of the skins marinate in the juice for 12 hours.","Strain the juice into a bowl and discard the peels.","In a pot, warm the sugar, glucose syrup, and 1 cup (240 ml) water over medium heat until it reaches 104F (40C).","Add 1 1/4 cups (100 g) of the infused grapefruit juice and mix.","Pour the mixture into the remaining 1 2/3 cups (400 g) infused grapefruit juice and incorporate the stabilizer using a hand blender.","Transfer to a Pacojet beaker and freeze; when ready to serve, spin up the sorbet. (Alternatively, freeze in an ice cream maker according to the manufacturer''s directions.)"}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', 'f6f5e2f4-1397-5ed3-a376-65cda6ef21a7', 'freshly squeezed grapefruit juice glucose syrup granulated sugar grapefruit sorbet stabilizer water|set aside the peels from   of the grapefruit  for the candied peel  and add the remaining peels  from   grapefruit  to the juice  using a strong hand blender  break apart the skins into the juice mixture  cover and let the bitterness of the skins marinate in the juice for   hours  strain the juice into a bowl and discard the peels  in a pot  warm the sugar  glucose syrup  and   cup   ml  water over medium heat until it reaches  f  c  add     cups   g  of the infused grapefruit juice and mix  pour the mixture into the remaining     cups   g  infused grapefruit juice and incorporate the stabilizer using a hand blender  transfer to a pacojet beaker and freeze  when ready to serve  spin up the sorbet   alternatively  freeze in an ice cream maker according to the manufacturer s directions'),
	('c705246b-4516-42ac-9d79-cabf53d2c72a', NULL, 'Spiced Almonds', '00:15:00', 190.00, '', NULL, '{"In a skillet (frying pan) warm the vegetable oil over medium heat.","Add the almonds. Stir until golden brown.","Place in a metal bowl, add the spices, and toss until the nuts are coated.","Place on a tray lined with paper towels and let cool."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', 'd41b7a21-23a4-5fbf-be63-a9a284f1a8ce', 'almonds (coarsely chopped) fine salt ground coriander seed ground cumin ground turmeric vegetable oil|in a skillet  frying pan  warm the vegetable oil over medium heat  add the almonds  stir until golden brown  place in a metal bowl  add the spices  and toss until the nuts are coated  place on a tray lined with paper towels and let cool'),
	('a409606a-583a-4c80-8664-ed5f3fa6716c', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Milk', '00:05:00', 1.00, NULL, 'cake', '{"Serve each cake immediately on some of the dried alfalfa hay (for decoration only) with a scoop of hay-smoked ice cream, either on the side or dropped right into the gooey center of the cake."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'x', 'b127def0-0fc7-5820-826b-9567ef4b7332', 'dried alfalfa hay hay-smoked ice cream|serve each cake immediately on some of the dried alfalfa hay  for decoration only  with a scoop of hay smoked ice cream  either on the side or dropped right into the gooey center of the cake'),
	('2679f951-2ba5-4e5d-a4b5-ba8b5fcb4931', 'c6d05fbc-03b1-463b-bc8b-7ef5284179d4', 'Sbrisolona Dough', '01:15:00', 612.00, '', NULL, '{"In a stand mixer fitted with the whisk attachment, cream the butter and sugar at high speed.","Coarsely chop the toasted almonds.","In a separate bowl, stir together the almonds, tipo \"00\" flour, cornmeal, and salt.","In another bowl, mix together the egg and grappa.","Once the butter is creamed, add half the egg mixture, and mix until fully incorporated, then repeat with the remaining egg mixture.","Replace the whisk with the paddle attachment and at the lowest speed start adding the dry ingredients.","Mix until you create a chunky dough; do not mix until homogenous. Make sure the chunks are no bigger than 3/8 inch (1 cm).","Cover the bowl with plastic wrap (cling film) and refrigerate for at least 1 hour."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '0fa768cc-d753-55fb-9e21-eebcf1de8929', 'cornmeal egg granulated sugar grappa salt tipo "00" flour toasted almonds unsalted butter|in a stand mixer fitted with the whisk attachment  cream the butter and sugar at high speed  coarsely chop the toasted almonds  in a separate bowl  stir together the almonds  tipo   flour  cornmeal  and salt  in another bowl  mix together the egg and grappa  once the butter is creamed  add half the egg mixture  and mix until fully incorporated  then repeat with the remaining egg mixture  replace the whisk with the paddle attachment and at the lowest speed start adding the dry ingredients  mix until you create a chunky dough  do not mix until homogenous  make sure the chunks are no bigger than   inch   cm  cover the bowl with plastic wrap  cling film  and refrigerate for at least   hour'),
	('dc1c74a8-fcf5-471c-bb88-aa3550135088', 'd65a5c65-2268-4451-bfb8-aba83fa1fba1', 'Pur de Patata Kennebec', '00:30:00', 240.00, '', NULL, '{"Cocer la patata cortada en dados en agua ligeramente salada a fuego lento.","Escurrir bien y chafar con tenedor dejando textura tosca.","Aadir entonces la mantequilla y trabajar poco y con suavidad para no dar elasticidad al pur.","Rectificar condimentacin.","Reservar en bao mara caliente."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', 'fd9f1f76-ca52-59af-95a2-d1ae6b0f0340', 'agua mantequilla patata kennebec pimienta sal|cocer la patata cortada en dados en agua ligeramente salada a fuego lento  escurrir bien y chafar con tenedor dejando textura tosca  aadir entonces la mantequilla y trabajar poco y con suavidad para no dar elasticidad al pur  rectificar condimentacin  reservar en bao mara caliente'),
	('4fdf8a5f-8177-437e-9fb6-9add5eb35d51', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Grapefruit Amaro', '00:10:00', 110.00, 'This is a bitter dish that we serve immediately after the main course. The grapefruit come right from Sicily, and their skins and white flesh are full of this wonderful bitterness and oil that really resets the palate and settles the stomach.', NULL, '{"At the base of each of eight cocktail glasses (we use vintage champagne coupes or martini glasses) or 5-inch (12 cm) diameter bowls, place 6 pieces of candied grapefruit peel.","Top each with a ball of sorbet and finally the foam to cover everything.","Pour 2 tablespoons (30 g) of the grapefruit and star anise liqueur into each glass and top with a rose petal."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'g', '11c7d418-c6d1-557a-8f0b-089bd84dacbb', 'candied grapefruit peel grapefruit and star anise liqueur grapefruit foam grapefruit sorbet rose petals|at the base of each of eight cocktail glasses  we use vintage champagne coupes or martini glasses  or  inch   cm  diameter bowls  place   pieces of candied grapefruit peel  top each with a ball of sorbet and finally the foam to cover everything  pour   tablespoons   g  of the grapefruit and star anise liqueur into each glass and top with a rose petal'),
	('51234625-ad66-4287-a641-449e461e00cd', NULL, '', '00:30:00', 1.00, NULL, NULL, '{""}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'x', '4f9561ea-5f1b-58d8-b33d-a162d3f10462', 'gstrica|'),
	('72ba50d9-1aeb-4ec4-a6cf-075a68727b2e', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Caramelized Milk', '00:30:00', 250.00, '', NULL, '{"Place all the ingredients in a 5-quart (5-liter) pot and bring to medium boil over medium-high heat.","When it begins to thicken, reduce the heat to medium and stir constantly until it turns a dark caramel color, about 20 minutes.","Pour into a sterilized half-pint (250 ml) glass jar and keep in the fridge until ready to use."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'ml', 'b0b0324f-9062-5344-95e7-8bd5552dfa87', 'cinnamon sticks granulated sugar salt whole milk|place all the ingredients in a  quart  liter  pot and bring to medium boil over medium high heat  when it begins to thicken  reduce the heat to medium and stir constantly until it turns a dark caramel color  about   minutes  pour into a sterilized half pint   ml  glass jar and keep in the fridge until ready to use'),
	('6794242b-e150-4380-a5de-068a9bacfac0', NULL, 'Esencia de gambas al ajillo', '00:25:00', 40.00, '', NULL, '{"Calentar el aceite y aadir el ajo y la guindilla, cuando est dorado aadir las cabezas de gamba y cocer sin que se pasen.","Retirar del fuego y cuando estn fras, exprimirlas una a una para recuperar el jugo.","Juntar con el aceite de saltearlas y el perejil.",Reservar.}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'ml', '6fb80512-a8d2-5e38-8494-d58f3caf069d', 'aceite de oliva ajo cabezas de gambas guindilla perejil picado|calentar el aceite y aadir el ajo y la guindilla  cuando est dorado aadir las cabezas de gamba y cocer sin que se pasen  retirar del fuego y cuando estn fras  exprimirlas una a una para recuperar el jugo  juntar con el aceite de saltearlas y el perejil  reservar'),
	('56fd2b1d-d5cc-47f7-a49e-c1d7099bd2a6', 'af49047e-3505-4700-b9bc-9c996ac74231', 'Gamba Al Ajillo con Papada de Cerdo', '00:15:00', 200.00, NULL, NULL, '{"Dorar en una sartn la papada con un poco de aceite por el lado de la piel hasta dejar dorada y crujiente.","Saltear la gamba procurando que no quede muy cocida, salpimentar.","Servir con la esencia caliente."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', 'a1e5b6f4-a2c2-51a5-9ba4-d4df628a51dc', 'aceite de oliva colas de gambas esencia de gambas al ajillo papada de cerdo cocida pimienta blanca molida sal|dorar en una sartn la papada con un poco de aceite por el lado de la piel hasta dejar dorada y crujiente  saltear la gamba procurando que no quede muy cocida  salpimentar  servir con la esencia caliente'),
	('b06a1030-b375-443e-9f90-435227d2b1cb', NULL, 'Fondo de Caza', '03:00:00', 500.00, '', NULL, '{"Cortar todos los huesos con el hacha para el jugo de ciervo.","Marcar el fondo de caza con las verduras en mirepoix por separado, agrupar en una sola marmita.","Mojar con el vino, reducir y aadir el agua o el fondo de carne a altura de conjunto.","Dejar reducir casi a seco, mojar de nuevo y repetir tres veces la operacin.","Espumar constantemente, colar por el colador fino.","Aadir el fondo oscuro a la gstrica preparada, a consistencia de jugo siempre controlando la potencia de sabor."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'ml', '4cbd69ea-a109-5352-9cf7-e8688705e86d', 'ajo apio cebolla gstrica huesos del carr vino tinto zanahoria|cortar todos los huesos con el hacha para el jugo de ciervo  marcar el fondo de caza con las verduras en mirepoix por separado  agrupar en una sola marmita  mojar con el vino  reducir y aadir el agua o el fondo de carne a altura de conjunto  dejar reducir casi a seco  mojar de nuevo y repetir tres veces la operacin  espumar constantemente  colar por el colador fino  aadir el fondo oscuro a la gstrica preparada  a consistencia de jugo siempre controlando la potencia de sabor'),
	('f55b39c3-90a5-4a7f-8845-875ae273b7fe', NULL, 'Smoked Beef Short Rib', '10:00:00', 400.00, NULL, NULL, '{"Preheat an offset smoker to 248F (120C) with oak and cherrywood.","Clean the beef, trimming off any tough and browned outer meat/fat from the aging process.","Rub 5 teaspoons of the mustard onto the meat and sprinkle all sides with the salt.","Place the meat in the smoker, bone side down, and cook until the meat has reached an internal temperature of 167F (75C), about 4 hours.","After the first hour of cooking, start mopping (brushing) the meat using the vinegar, oil, butter, or juice every half an hour.","Meanwhile, halve and pit (stone) the apricots. Set them in a baking pan and place the pan under the grill grates where the meat is so that they catch all the drippings. Remove the apricots after 1 hour, but leave the pan under the beef.","After 4 hours, wrap the meat first in butcher paper and then aluminum foil.","Bring the smoker temperature down to 212F (100C) and continue to cook until the meat reaches an internal temperature of 203F (95C), another 45 hours.","Let the meat rest for at least 30 minutes.","Preheat a wood-burning oven to 572F (300C) or use a broiler.","Return the pan with the beef drippings (where the apricots were) to a fire source or high heat stovetop.","When the pan is hot, deglaze it with the marigold vinegar and reduce by half.","Reduce the heat to medium, add the remaining 2 teaspoons of mustard and the beef broth and let reduce again until it is thick and covers the back of a spoon.","Strain the sauce.","Cut off 4 portions of the short rib and drench them in the sauce.","Place in the oven to broil (grill) the outside.","Serve the beef with the smoked apricots and the spiced almonds."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'g', 'ebe43477-d541-56d8-ab53-3e2277891b6a', 'beef broth or chicken stock beef short rib slab (28-day-aged piedmontese, 4-rib) dijon mustard fresh apricots marigold vinegar salt spiced almonds vinegar, seasoned oil, butter, or apricot juice|preheat an offset smoker to  f  c  with oak and cherrywood  clean the beef  trimming off any tough and browned outer meat fat from the aging process  rub   teaspoons of the mustard onto the meat and sprinkle all sides with the salt  place the meat in the smoker  bone side down  and cook until the meat has reached an internal temperature of  f  c  about   hours  after the first hour of cooking  start mopping  brushing  the meat using the vinegar  oil  butter  or juice every half an hour  meanwhile  halve and pit  stone  the apricots  set them in a baking pan and place the pan under the grill grates where the meat is so that they catch all the drippings  remove the apricots after   hour  but leave the pan under the beef  after   hours  wrap the meat first in butcher paper and then aluminum foil  bring the smoker temperature down to  f  c  and continue to cook until the meat reaches an internal temperature of  f  c  another   hours  let the meat rest for at least   minutes  preheat a wood burning oven to  f  c  or use a broiler  return the pan with the beef drippings  where the apricots were  to a fire source or high heat stovetop  when the pan is hot  deglaze it with the marigold vinegar and reduce by half  reduce the heat to medium  add the remaining   teaspoons of mustard and the beef broth and let reduce again until it is thick and covers the back of a spoon  strain the sauce  cut off   portions of the short rib and drench them in the sauce  place in the oven to broil  grill  the outside  serve the beef with the smoked apricots and the spiced almonds'),
	('fd0fd1b5-39e4-453d-bc12-c75946afa301', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Smoked Meringue', '01:40:00', 150.00, '', NULL, '{"Preheat an offset smoker to 266F (130C) with cherrywood. (Alternatively, preheat a regular oven to the same temperature, although you will not achieve the deep smoky flavor.)","In a stand mixer fitted with the whisk attachment, whip the egg whites at medium speed until foamy.","Slowly start adding the sugar. Let it continue to whip until it reaches three times its volume and forms a stiff peak.","Add the cornstarch (cornflour) and vinegar and mix for 10 more seconds to fully incorporate.","Line a 13 x 18-inch (33 x 46 cm) sheet pan with a silicone baking mat or parchment (baking) paper.","Spread the meringue to a thickness of 1 inch (2.5 cm) using an offset spatula.","Place the pan in the smoker and smoke for 1 1/2 hours.","Remove from the oven and let cool to room temperature.","Store the meringue at room temperature, in a dry place, in an airtight container for up to 1 week."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '460ad186-357b-5a4d-8adb-1c578d693f21', 'eggs granulated sugar|preheat an offset smoker to  f  c  with cherrywood   alternatively  preheat a regular oven to the same temperature  although you will not achieve the deep smoky flavor  in a stand mixer fitted with the whisk attachment  whip the egg whites at medium speed until foamy  slowly start adding the sugar  let it continue to whip until it reaches three times its volume and forms a stiff peak  add the cornstarch  cornflour  and vinegar and mix for   more seconds to fully incorporate  line a   x  inch   x   cm  sheet pan with a silicone baking mat or parchment  baking  paper  spread the meringue to a thickness of   inch   cm  using an offset spatula  place the pan in the smoker and smoke for     hours  remove from the oven and let cool to room temperature  store the meringue at room temperature  in a dry place  in an airtight container for up to   week'),
	('5b3d2efa-cd8a-4548-bbfa-179179e72d46', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'White Chocolate and Sage Muffins', '00:45:00', 20.00, NULL, 'mini muffins', '{"Preheat the oven to 350F (175C/Gas Mark 4).","Grease 20 cups of two mini muffin pans or silicone leaf molds with butter.","In a small blender, blend the Greek yogurt and sage until smooth. Set aside.","In a stand mixer fitted with the paddle attachment, cream the sugar and butter.","Add the eggs one at a time, making sure the first is incorporated before adding the second.","Scrape out the seeds from the vanilla bean and add to the butter mix.","Keep mixing until everything is fully incorporated.","In a separate bowl, sift together the flour, baking powder, baking soda, and salt.","Add these dry ingredients to the butter mix in three additions, always making sure that the first part is well incorporated before adding the next.","With a rubber spatula, fold in the sage and yogurt mixture and white chocolate chips.","Fill the mini muffin cups or silicone leaf molds three-quarters full with the muffin batter.","Bake until a toothpick inserted into a muffin comes out clean, about 18 minutes.","Remove from the oven and let cool to room temperature before removing from the molds and serving."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'x', '8d066293-c3ab-5168-b253-cc24784f1739', 'all-purpose flour baking powder baking soda eggs granulated sugar greek yogurt sage salt unsalted butter vanilla bean white chocolate chips|preheat the oven to  f  c gas mark   grease   cups of two mini muffin pans or silicone leaf molds with butter  in a small blender  blend the greek yogurt and sage until smooth  set aside  in a stand mixer fitted with the paddle attachment  cream the sugar and butter  add the eggs one at a time  making sure the first is incorporated before adding the second  scrape out the seeds from the vanilla bean and add to the butter mix  keep mixing until everything is fully incorporated  in a separate bowl  sift together the flour  baking powder  baking soda  and salt  add these dry ingredients to the butter mix in three additions  always making sure that the first part is well incorporated before adding the next  with a rubber spatula  fold in the sage and yogurt mixture and white chocolate chips  fill the mini muffin cups or silicone leaf molds three quarters full with the muffin batter  bake until a toothpick inserted into a muffin comes out clean  about   minutes  remove from the oven and let cool to room temperature before removing from the molds and serving'),
	('59fa064c-c2fb-47db-bb31-60597d1291a8', NULL, 'Pralin salado de cacahuete', '00:10:00', 120.00, '', NULL, '{"Triturar los cacahuetes con aceite de oliva.","Sazonar al gusto y poner en bibern."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', 'd781687a-609d-597c-80b9-4d74e98e3bc2', 'aceite de oliva cacahuete frito pimienta sal|triturar los cacahuetes con aceite de oliva  sazonar al gusto y poner en bibern'),
	('81cc343c-92d4-45be-abd6-92f40dd6aa05', NULL, 'Chocolate Chip Cookie Dough', '00:45:00', 750.00, '', NULL, '{"In a stand mixer fitted with the whisk attachment, cream the butter and both sugars.","Mix in the vanilla seeds and egg.","In another bowl, whisk together the flour, baking soda (bicarbonate of soda), and salt.","Gradually add the flour mixture to the butter until well incorporated.","By hand, fold in the chocolate chips.","Let rest in the fridge for at least 30 minutes."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', 'fa73f649-077b-5d13-be5b-3abd020866cf', 'all-purpose (plain) flour baking soda (bicarbonate of soda) dark chocolate chips egg granulated sugar kosher (flaky) salt muscovado sugar salted butter vanilla bean|in a stand mixer fitted with the whisk attachment  cream the butter and both sugars  mix in the vanilla seeds and egg  in another bowl  whisk together the flour  baking soda  bicarbonate of soda  and salt  gradually add the flour mixture to the butter until well incorporated  by hand  fold in the chocolate chips  let rest in the fridge for at least   minutes'),
	('936241b8-89de-4e19-b7a9-56ad77e4a5da', '319c056d-83b5-4e15-abf9-ca5e3244c9fd', 'Chocolate Chip Cookies', '00:20:00', 1.00, NULL, 'cookie', '{"Preheat the oven to 350F (180C/Gas Mark 4).","Line two baking sheets with parchment (baking) paper.","Portion the dough into 30 balls of about 1 ounce (25 g) each and arrange on the lined baking sheets, about 2 inches (5 cm) apart.","Bake until the edges become slightly toastedthe cookies will flatten out, but the centers still seem slightly rawabout 8 minutes.","Remove from the baking sheet and let cool on a wire rack."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'x', '72d876cb-9d82-52e9-b5fe-061687ead19b', 'chocolate chip cookie dough|preheat the oven to  f  c gas mark   line two baking sheets with parchment  baking  paper  portion the dough into   balls of about   ounce   g  each and arrange on the lined baking sheets  about   inches   cm  apart  bake until the edges become slightly toasted the cookies will flatten out  but the centers still seem slightly raw about   minutes  remove from the baking sheet and let cool on a wire rack'),
	('a5010108-3d74-4431-820d-75dcfd360b96', NULL, 'Relleno para Liebre', '00:30:00', 1200.00, '', NULL, '{"Cortar en cubos pequeos las carnes, los interiores de la liebre y pasar todo por la picadora de carne con el grano medio.",Reservar.,"Aadir el jugo de trufa, la sangre, y la carne picada de cerdo, el aceite de oliva, el brandy, el armaac, el azcar, la sal, la pimienta, la nuez moscada (si se usa), las escaluas picadas y el aceite de trufa.","Mezclar todo.",Reservar.}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', '3ca35f4a-2489-50f4-84f1-cf1e100a6a32', 'aceite de oliva aceite de trufa armaac azcar brandy cabeza de lomo de cerdo carne picada de cerdo culata de ternera escaluas flor de sal foie gras jugo de trufa panceta ibrica pimienta de molino sangre de cerdo|cortar en cubos pequeos las carnes  los interiores de la liebre y pasar todo por la picadora de carne con el grano medio  reservar  aadir el jugo de trufa  la sangre  y la carne picada de cerdo  el aceite de oliva  el brandy  el armaac  el azcar  la sal  la pimienta  la nuez moscada  si se usa  las escaluas picadas y el aceite de trufa  mezclar todo  reservar'),
	('c029422b-1162-4207-840e-c3cb83b3f0eb', NULL, 'Lomo de ciervo albardado con guanciale', '01:30:00', 1.00, NULL, 'racines_completas', '{"Deshuesar el carre de corzo eliminado de los lomos todo el tejido conjuntivo, grasas y tendones.","Racionar en 150 gr por racin.","Marinar las raciones de corzo al vaco con la marinada preparada.","Escurrir los lomos y sellarlos por todos los lados en una sartn, enfriarlos.","Cortar muy finamente el guiancale.","Albardarlo con el tocino ibrico y bridar si fuera necesario.","Reservarlo en la cmara.","Para las patatas (pomme ratt): Disponer las patatas en una bolsa al vaco salpimentadas y con la mantequilla.","Cocinar durante 20 min a 85C.","Abatir y reservar.","Sacar de la bolsa cortar de forma decorativa y, rissolar con la mantequilla y un poco de aceite.","Para las acelgas: Retirar con una puntilla la penca de la hoja, reservar por separado.","Retirar el exceso de fibras con una puntilla.","Poner las pencas en un agua hirviendo con sal durante 1 min.","Poner las hojas en el agua hirviendo.","Sacar las pencas y las hojas en agua con hielo.","Cortar para el servicio y reservar.","Acabado y presentacin: Terminar en horno 180C el ciervo, temperatura a corazn 48C.","Reposar la pieza en aluminio, cortamos el lomo en dos y presentamos.","Disponer las patatas rissoladas cortadas en discos alrededor.","Disponer encima los trozos de penca de acelga y en la parte superior unos discos de hoja de acelga.","Terminar con el jugo (fondo de caza) de bien caliente y unos puntos de pralin."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'x', 'e91e1881-bf33-5e00-b569-449490c3dbc5', 'aceite de oliva acelga verde carr de ciervo fondo de caza guanciale mantequilla marinada de caza pimienta pomme ratt pralin salado de cacahuete sal|deshuesar el carre de corzo eliminado de los lomos todo el tejido conjuntivo  grasas y tendones  racionar en   gr por racin  marinar las raciones de corzo al vaco con la marinada preparada  escurrir los lomos y sellarlos por todos los lados en una sartn  enfriarlos  cortar muy finamente el guiancale  albardarlo con el tocino ibrico y bridar si fuera necesario  reservarlo en la cmara  para las patatas  pomme ratt  disponer las patatas en una bolsa al vaco salpimentadas y con la mantequilla  cocinar durante   min a  c  abatir y reservar  sacar de la bolsa cortar de forma decorativa y  rissolar con la mantequilla y un poco de aceite  para las acelgas  retirar con una puntilla la penca de la hoja  reservar por separado  retirar el exceso de fibras con una puntilla  poner las pencas en un agua hirviendo con sal durante   min  poner las hojas en el agua hirviendo  sacar las pencas y las hojas en agua con hielo  cortar para el servicio y reservar  acabado y presentacin  terminar en horno  c el ciervo  temperatura a corazn  c  reposar la pieza en aluminio  cortamos el lomo en dos y presentamos  disponer las patatas rissoladas cortadas en discos alrededor  disponer encima los trozos de penca de acelga y en la parte superior unos discos de hoja de acelga  terminar con el jugo  fondo de caza  de bien caliente y unos puntos de pralin'),
	('e62f4d93-76fe-4dbc-8ec7-7831f7e97a32', 'af49047e-3505-4700-b9bc-9c996ac74231', 'Cigala frita con miel, ssamo, verduras crocantes y salsa de soja', '00:20:00', 320.00, NULL, NULL, '{"Secar bien las cigalas, pasarlas por harina, sacudir el exceso.","Pasarlas por tempura y frer a 170C hasta dejarlas cocidas y crujientes.","En una sartn aparte, y caliente, aadir un poco de aceite y saltear las cigalas fritas.","Agregar la miel (10 g), saltear y caramelizar ligeramente y espolvorear con el ssamo (6 g).","Servir sobre un lecho de verduritas y salsa alrededor."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', 'd5d7e2ba-f111-5223-85a2-2993e59b439f', 'aceite de oliva colas de cigala peladas harina miel salsa de soja y miel ssamo tostado tempura base verduras crocantes|secar bien las cigalas  pasarlas por harina  sacudir el exceso  pasarlas por tempura y frer a  c hasta dejarlas cocidas y crujientes  en una sartn aparte  y caliente  aadir un poco de aceite y saltear las cigalas fritas  agregar la miel   g  saltear y caramelizar ligeramente y espolvorear con el ssamo   g  servir sobre un lecho de verduritas y salsa alrededor'),
	('db1f1848-742f-4205-a8c0-6a2a07b5b7ef', NULL, 'Marinada para Liebre', '00:20:00', 2500.00, '', NULL, '{"Lavar y pelar si necesario, cortar en mirepoix las verduras.","Colocar todos los ingredientes en un recipiente para marinar junto con los huesos de la liebre y el vino tinto."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'ml', 'c2f8acc8-1607-5f52-a8ff-be863e6db97d', 'aceite de oliva ajo apio bola apio rama bayas de enebro escalua flor de sal pimienta negra en grano tomillo vino tinto zanahoria|lavar y pelar si necesario  cortar en mirepoix las verduras  colocar todos los ingredientes en un recipiente para marinar junto con los huesos de la liebre y el vino tinto'),
	('e0f00f6d-be49-4751-a972-c605bbf56750', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Gigot de cordero al chilindrn con acelgas', '00:45:00', 350.00, NULL, NULL, '{"Deshuesar la pierna.","Retirar el excedente de grasa.","Bridar la pierna.",Salpimentar.,"Dorar la pierna en la sartn y cocinar con la salsa chilindrn durante 15-20 minutos.","Glasear las pencas de acelga con mantequilla y fondo de ave.","Filetear la pierna, emplatar y napar con la salsa.","Guarnecer con las pencas."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'g', '6d282c1c-f8c3-51cb-ae64-6091ff11d501', 'empty|deshuesar la pierna  retirar el excedente de grasa  bridar la pierna  salpimentar  dorar la pierna en la sartn y cocinar con la salsa chilindrn durante   minutos  glasear las pencas de acelga con mantequilla y fondo de ave  filetear la pierna  emplatar y napar con la salsa  guarnecer con las pencas'),
	('14f0a382-1c85-44fe-bdc4-ff71db62ad08', NULL, 'Pechugas de Pichn Encrepinadas', '00:20:00', 1.00, '', NULL, '{"Espolvorear las pechugas con la pimienta y el laurel en polvo.","Envolver en crepina.","Bridar y reservar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'x', 'dcf115d6-f465-555a-b71b-8ec7171a664d', 'crepina laurel en polvo pechugas de pichn pimienta negra molida|espolvorear las pechugas con la pimienta y el laurel en polvo  envolver en crepina  bridar y reservar'),
	('9cf60c9d-351b-4f67-9396-ed3c26d0e46f', NULL, 'Agar Agar Celeri/Trufa', '00:45:00', 1000.00, '', NULL, '{"Pelar y cortar el apio bola, picar las escaluas y pochar todo con mantequilla en una cazuela sin coloracin.","Aadir el fondo blanco y la leche.","Cocer a fuego lento.","Aadir la nata y hacer reducir.","Triturar en la Thermomix.","Colar y rectificar de sal.","Aadir el agar agar y llevar a ebullicin para activar la gelificacin.","Incorporar el jugo de trufa, el Oporto y la tinta de sepia si se desea color.","Dejar enfriar para que cuaje si es necesario o servir como crema espesa."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', '72e63c7d-ada1-58db-9f77-861981d5ef60', 'agar agar apio bola cebolletas escaluas fondo blanco jugo de trufa leche mantequilla nata 35% oporto tinta de sepia trufa negra en trozos|pelar y cortar el apio bola  picar las escaluas y pochar todo con mantequilla en una cazuela sin coloracin  aadir el fondo blanco y la leche  cocer a fuego lento  aadir la nata y hacer reducir  triturar en la thermomix  colar y rectificar de sal  aadir el agar agar y llevar a ebullicin para activar la gelificacin  incorporar el jugo de trufa  el oporto y la tinta de sepia si se desea color  dejar enfriar para que cuaje si es necesario o servir como crema espesa'),
	('d706a459-748d-40e4-8503-4b3f76a226a9', NULL, 'Gstrica', '00:15:00', 150.00, '', NULL, '{}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', 'f3f5c2fa-fa00-52a6-9917-d8c1f7f68059', 'azcar vino tinto|'),
	('643795cb-f39d-4efa-b6e5-82512f31303b', 'a2dc7af4-a700-4136-add9-286bf9b67490', 'Caneln de Aguacate con Bogavante', '00:30:00', 250.00, NULL, NULL, '{"Cortar finas lminas de aguacate con la mandolina y extender sobre papel film acostando una lmina sobre la otra.","Disponer el relleno de bogavante sobre las lminas de aguacate y enrollar como caneln. Obtener canelones de 10 cm de largo con un dimetro de 3 cm.","Para el acabado, pasar 4 lminas de aguacate por la masa de tempura y frer en el aceite de oliva hasta dejar crujientes.","Disponer todos los elementos con elegancia y sobriedad."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', 'f97513db-04a1-5895-9449-391c10aea060', 'aceite de oliva aguacate relleno de bogavante tempura base|cortar finas lminas de aguacate con la mandolina y extender sobre papel film acostando una lmina sobre la otra  disponer el relleno de bogavante sobre las lminas de aguacate y enrollar como caneln  obtener canelones de   cm de largo con un dimetro de   cm  para el acabado  pasar   lminas de aguacate por la masa de tempura y frer en el aceite de oliva hasta dejar crujientes  disponer todos los elementos con elegancia y sobriedad'),
	('d23e23ee-cf89-4079-b707-2e6fa862ba20', NULL, 'Fondo de Cebolla', '00:45:00', 600.00, '', NULL, '{"Rehogar lentamente la cebolla eminc en el aceite hasta que tome un color dorado.","Mojar con el fondo y cocer tapado 30 minutos.","Colar y desengrasar.","Obtener 600 ml. y reservar."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'ml', '0e3f8c31-bcf3-5ad8-bfe3-f50a6b0285e2', 'aceite de oliva cebolla fondo de ave|rehogar lentamente la cebolla eminc en el aceite hasta que tome un color dorado  mojar con el fondo y cocer tapado   minutos  colar y desengrasar  obtener   ml  y reservar'),
	('76c6ef28-9826-4030-8e5b-ca7338c71d1d', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Chuletn de buey picado de aceitunas y salsa bearnesa', '00:45:00', 700.00, NULL, NULL, '{"Preparar el chuletn retirando los excesos de grasa y si hace falta se ata alrededor para que mantenga la forma.","Realizar unas incisiones en la nuez del chuletn e insertar las aceitunas sin hueso.","Proceder a la coccin al gusto o en una cocotte Staub o con aceite de oliva.","Marcar por todos los lados y aadir la mantequilla, el ajo y el tomillo, ir regando con la mezcla.","Acabar la coccin al punto que se desea.","Dejar reposar.","Servir el chuletn en una fuente o bandeja de madera previamente cortado, las patatas Pont Neuf y la salsa bearnesa aparte."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'g', 'f3882acb-2022-5148-bf01-fcbadec235ee', 'aceite de oliva aceitunas negras sin hueso ajo morado chuletn (1.4 kg) mantequilla patatas pont neuf pimienta negra de molino sal salsa bearnesa clasica tomillo fresco|preparar el chuletn retirando los excesos de grasa y si hace falta se ata alrededor para que mantenga la forma  realizar unas incisiones en la nuez del chuletn e insertar las aceitunas sin hueso  proceder a la coccin al gusto o en una cocotte staub o con aceite de oliva  marcar por todos los lados y aadir la mantequilla  el ajo y el tomillo  ir regando con la mezcla  acabar la coccin al punto que se desea  dejar reposar  servir el chuletn en una fuente o bandeja de madera previamente cortado  las patatas pont neuf y la salsa bearnesa aparte'),
	('578c75b2-6a65-4969-9120-4bbf5492ab6b', NULL, 'Salsa de cordero al chilindrn', '00:45:00', 1200.00, '', NULL, '{"Dorar los trozos en aceite.","Aadir las verduras y sofrer el conjunto.","Aadir la pulpa de pimiento choricero y rehogar.","Aadir el tomate y cocinar.","Mojar con el vino blanco y reducir.","Aadir el caldo de cordero y tapar.","Terminar la coccin y aadir ms fondo si fuera necesario.","Pasar por el chino fino.","Reducir y texturizar con xantana si es necesario (3g/litro)."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'ml', 'ea21bdff-35f2-5758-a27f-d8be271974d6', 'aceite de oliva ajo caldo de cordero cebolla en juliana pulpa de pimiento choricero tomate vino blanco xantana|dorar los trozos en aceite  aadir las verduras y sofrer el conjunto  aadir la pulpa de pimiento choricero y rehogar  aadir el tomate y cocinar  mojar con el vino blanco y reducir  aadir el caldo de cordero y tapar  terminar la coccin y aadir ms fondo si fuera necesario  pasar por el chino fino  reducir y texturizar con xantana si es necesario  g litro'),
	('5fe97667-3cab-4046-b6ad-7c9424320fd1', NULL, 'Esponjoso de bacalao', '04:10:00', 1.00, 'Asegurar un mnimo de 3 horas de nevera para cuajar.', NULL, '{"Juntar en fro las espinas con la nata y llevar a ebullicin.","Cocer a fuego lento 10 minutos, dejar infusionar en un lugar tibio una hora mnimo.","Recuperar 300 ml.","Incorporar la gelatina ya remojada, colar la preparacin y reservar refrigerado en un bol.","Montar la clara a punto de nieve suave e incorporarla al preparado anterior.","Decantar en moldes y cuajar en nevera al menos 3 horas."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'x', 'a9f28cec-0bdb-5ae6-9762-f1a98da8dc23', 'empty|juntar en fro las espinas con la nata y llevar a ebullicin  cocer a fuego lento   minutos  dejar infusionar en un lugar tibio una hora mnimo  recuperar   ml  incorporar la gelatina ya remojada  colar la preparacin y reservar refrigerado en un bol  montar la clara a punto de nieve suave e incorporarla al preparado anterior  decantar en moldes y cuajar en nevera al menos   horas'),
	('7ac9e97a-3ce5-4ccb-9d19-272feafe0986', NULL, 'Salsa Bearnesa Clasica', '00:30:00', 500.00, '', NULL, '{"Picar finamente las escaluas y pochar sin coloracin en una cazuela con mantequilla y sal.","Cuando estn transparentes, aadir la pimienta en mignonette, desglasar con el vinagre, aadir la mitad del manojo de estragn y reducir de mitad.","Filtrar y reservar.","Montar al bao Mara las yemas con el vinagre fro y un poco de agua.","Acabar con la mantequilla fundida previamente clarificada y las hojas del estragn picadas finamente.","Opcional: aadir tambin las escaluas con la pimienta o solo servir las escaluas con la mantequilla y el estragn fresco."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', '80da56b2-b4ac-5edb-987a-a20e6ad59037', 'escaluas estragn fresco mantequilla clarificada pimienta negra sal vinagre de estragn yema de huevo fresca|picar finamente las escaluas y pochar sin coloracin en una cazuela con mantequilla y sal  cuando estn transparentes  aadir la pimienta en mignonette  desglasar con el vinagre  aadir la mitad del manojo de estragn y reducir de mitad  filtrar y reservar  montar al bao mara las yemas con el vinagre fro y un poco de agua  acabar con la mantequilla fundida previamente clarificada y las hojas del estragn picadas finamente  opcional  aadir tambin las escaluas con la pimienta o solo servir las escaluas con la mantequilla y el estragn fresco'),
	('1f8d740b-de7c-4af6-b6cd-61348a693d7d', NULL, 'Patatas Pont Neuf', '00:30:00', 300.00, '', NULL, '{"Pelar las patatas, cortar en medida Pont Neuf.","Proceder a cocer en un primer bao de grasa a 140C.","Frer despus a 180C.","Escurrir en papel absorbente y sazonar con sal."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'g', '1ff4ff4f-bf86-5cce-b71b-9d8987c3fc48', 'aceite de fritura o girasol patatas sal|pelar las patatas  cortar en medida pont neuf  proceder a cocer en un primer bao de grasa a  c  frer despus a  c  escurrir en papel absorbente y sazonar con sal'),
