	('2ab2663f-d688-4370-b48a-3f90b28fe0b7', NULL, 'Corona de cordero (Preparacin)', '00:20:00', 1.00, '', NULL, '{"Recortar bien el carr y bajar cuidadosamente la carne de las costillas, cortar.","Repelar bien las costillas. Cortar la parte de hueso de la columna.","Hacer la corona y bridar.",Salpimentar.}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'x', 'b1e19dcd-1e5a-5380-b56f-71ada29d9e19', 'carr de cordero pimienta sal|recortar bien el carr y bajar cuidadosamente la carne de las costillas  cortar  repelar bien las costillas  cortar la parte de hueso de la columna  hacer la corona y bridar  salpimentar'),
	('4e978f63-0059-44a6-a31e-3d968c231c4a', NULL, 'Gstrica de naranja', '00:20:00', 250.00, '', NULL, '{}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Preparation', 'ml', 'da79655c-4f2d-5d65-843d-c9222dec6675', 'azcar rubia jugo de limn sal vinagre de manzana zumo de naranja|'),
