	('4524a198-880c-4dbe-908d-3f2c00a181d7', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Corona de cordero con jugo de cordero a la naranja', '00:45:00', 1.00, NULL, 'corona', '{"Hornear la corona 30 minutos a 180C dependiendo del peso del animal.","Dejar reposar la carne 10 min.","Regenerar, glasear con la salsa y desbridar.","Rociar con el resto de la salsa."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'x', '3b0ff157-709d-5c8f-9de7-ed0341c62cff', 'corona de cordero (preparacin) salsa de cordero a la naranja|hornear la corona   minutos a  c dependiendo del peso del animal  dejar reposar la carne   min  regenerar  glasear con la salsa y desbridar  rociar con el resto de la salsa'),
	('3a7488a4-a892-46f1-b9df-6663219a7750', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Gigot de cordero 1', '00:45:00', 350.00, NULL, NULL, '{"Deshuesar la pierna.","Retirar el excedente de grasa.","Bridar la pierna.",Salpimentar.,"Dorar la pierna en la sartn y cocinar con la salsa chilindrn durante 15-20 minutos.","Glasear las pencas de acelga con mantequilla y fondo de ave.","Filetear la pierna, emplatar y napar con la salsa.","Guarnecer con las pencas."}', '816f8fdb-fedd-4e6e-899b-9c98513e49c5', NULL, 'Dish', 'g', '6d282c1c-f8c3-51cb-ae64-6091ff11d501', 'empty|deshuesar la pierna  retirar el excedente de grasa  bridar la pierna  salpimentar  dorar la pierna en la sartn y cocinar con la salsa chilindrn durante   minutos  glasear las pencas de acelga con mantequilla y fondo de ave  filetear la pierna  emplatar y napar con la salsa  guarnecer con las pencas'),
	('4cbb63c1-37ec-467c-a50b-a42c12af55a9', NULL, 'Los frutos secos', '00:30:00', 40.00, '', NULL, '{"Remojar las pasas en el vino dulce de naranja hasta que se hinchen."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '30eacc8b-b9f3-5247-a5c1-afea0c81e4b0', 'empty|remojar las pasas en el vino dulce de naranja hasta que se hinchen'),
	('aa2969a0-4e12-4d9e-816b-3d8a253d6a97', NULL, 'Salsa de naranja', '00:20:00', 50.00, '', NULL, '{"Calentar el vino dulce de naranja en un cazo y dejar evaporar lentamente hasta consistencia de jarabe.","Tener en cuenta que es una preparacin para servir en fro."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'ml', '591a16b8-228d-599a-a8cc-f17c9df81c4e', 'empty|calentar el vino dulce de naranja en un cazo y dejar evaporar lentamente hasta consistencia de jarabe  tener en cuenta que es una preparacin para servir en fro'),
	('ddaf4029-6c40-49ec-8b01-a322c7c20165', NULL, 'Espinacas de base', '00:05:00', 110.00, '', NULL, '{"Frotar en un bol el diente de ajo.","Aliar en l las espinacas con sal y aceite de oliva virgen."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '7d9ca796-5567-5601-8796-fc0fc523f67f', 'empty|frotar en un bol el diente de ajo  aliar en l las espinacas con sal y aceite de oliva virgen'),
	('a072130b-332b-43b2-9ca3-78812ea93402', NULL, 'Fennel Water', '01:05:00', 1.00, '', NULL, '{"Put the fennel into a glass bottle.","Pour in 4 cups (900 ml) water and the strained lemon juice.","Refrigerate for 1-2 hours before you drink it.","Refill up to three times."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'l', '5d12d196-8193-52ec-9ead-4bd0e37da761', 'empty|put the fennel into a glass bottle  pour in   cups   ml  water and the strained lemon juice  refrigerate for   hours before you drink it  refill up to three times'),
	('e64e7d83-645c-4a59-a4fe-5023b4bbf494', NULL, 'Apple Mostarda', '48:20:00', 1.00, '', NULL, '{"Peel the apples and cut into wedges, removing the core.","In a large bowl, mix the apples with the sugar.","Cover the bowl with plastic wrap (cling film), pressing it directly onto the surface of the apples.","Let rest in the fridge for 24 hours.","After the first 24 hours, drain the liquid from the apples into a saucepan.","Bring to a boil, then pour it back over the apples while still hot.","Re-cover with plastic wrap just as the day before.","Let rest for another 24 hours.","Pour all the contents of the bowl into a pot, including the apples this time.","Bring to a boil, and let simmer for 8 minutes.","Remove from heat.","Add the drops of mustard essence and stir once or twice.","Pour all the contents of the pot into a sterilized 1-quart (1-liter) jar, leaving a 3/8-inch (1 cm) head space.","Leave to cool, then cover and seal with a lid."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'l', 'f472ec71-f4c6-50d9-83a1-5b8e4ee5ffc2', 'empty|peel the apples and cut into wedges  removing the core  in a large bowl  mix the apples with the sugar  cover the bowl with plastic wrap  cling film  pressing it directly onto the surface of the apples  let rest in the fridge for   hours  after the first   hours  drain the liquid from the apples into a saucepan  bring to a boil  then pour it back over the apples while still hot  re cover with plastic wrap just as the day before  let rest for another   hours  pour all the contents of the bowl into a pot  including the apples this time  bring to a boil  and let simmer for   minutes  remove from heat  add the drops of mustard essence and stir once or twice  pour all the contents of the pot into a sterilized  quart  liter  jar  leaving a  inch   cm  head space  leave to cool  then cover and seal with a lid'),
	('fb50763a-cd39-4c9b-ab3e-bacec385c8cd', NULL, 'Relleno de Bogavante', '00:45:00', 600.00, '', NULL, '{"Hervir los bogavantes en abundante agua salada durante 8 minutos. Enfriar en agua helada.","Retirar las cscaras del cuerpo y las pinzas.","Cortar los bogavantes en dados y reservar 4 medallones bonitos y las pinzas.","Para la marinada: Triturar 100 g de cebolla y 250 g de tomate, y colar.","En el lquido obtenido de la marinada, marinar los bogavantes.","Picar 80 g de cebolla (cisel) y cortar 80 g de tomate en dados.","Juntar los bogavantes con la cebolla picada, el tomate en dados, el perejil, los retales de aguacate, el vinagre, el aceite de oliva virgen extra, sal y pimienta.","Dejar madurar unos minutos."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Preparation', 'g', '836eec82-8276-5c03-bca7-b5b8f5adfa35', 'aceite de oliva virgen extra agua aguacate bogavante cebolla perejil picado pimienta blanca molida sal tomate vinagre chardonnay|hervir los bogavantes en abundante agua salada durante   minutos  enfriar en agua helada  retirar las cscaras del cuerpo y las pinzas  cortar los bogavantes en dados y reservar   medallones bonitos y las pinzas  para la marinada  triturar   g de cebolla y   g de tomate  y colar  en el lquido obtenido de la marinada  marinar los bogavantes  picar   g de cebolla  cisel  y cortar   g de tomate en dados  juntar los bogavantes con la cebolla picada  el tomate en dados  el perejil  los retales de aguacate  el vinagre  el aceite de oliva virgen extra  sal y pimienta  dejar madurar unos minutos'),
	('21772578-3548-4cb8-9593-70435fb3e52b', NULL, 'Amarena Jam', '12:40:00', 500.00, '', NULL, '{"In a large bowl, toss the cherries and sugar together and let sit in the fridge for 12 hours.","Place a shallow dish or saucer in the freezer.","Transfer the cherries and sugar to an 11-inch (28 cm) pan and warm over low heat until all the sugar is dissolved.","Increase the heat to medium and cook, stirring constantly, until the liquid has evaporated and the fruit begins to break down, 25-35 minutes.","To test if the jam is ready, remove the dish from the freezer and drop a spoonful of the jam onto it.","Let it sit there for 10-15 seconds, then drag your finger through it. If a clean line appears and remains, the jam is ready.","Transfer to a sterilized 1-pint (500 ml) glass jar.","Leave to cool, then cover and seal with a lid."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'ml', '2143f44d-70dd-529e-ac20-813b02fe0d1b', 'empty|in a large bowl  toss the cherries and sugar together and let sit in the fridge for   hours  place a shallow dish or saucer in the freezer  transfer the cherries and sugar to an  inch   cm  pan and warm over low heat until all the sugar is dissolved  increase the heat to medium and cook  stirring constantly  until the liquid has evaporated and the fruit begins to break down    minutes  to test if the jam is ready  remove the dish from the freezer and drop a spoonful of the jam onto it  let it sit there for   seconds  then drag your finger through it  if a clean line appears and remains  the jam is ready  transfer to a sterilized  pint   ml  glass jar  leave to cool  then cover and seal with a lid'),
	('8cac55b0-29e9-4211-9666-3303913b9b66', NULL, 'Strawberry Grape and Balsamic Jam', '01:00:00', 500.00, '', NULL, '{"Place a shallow dish or saucer in the freezer.","Thoroughly wash the strawberry grapes and remove the stems.","In a pot, using a potato masher, crush the grapes.","Cover with water, bring to a boil, and simmer for 5 minutes.","Strain out the water and transfer the grapes to a ricer or food mill and pass the mixture through to preserve the pulp but remove the seeds.","Place the grapes in an 11-inch (28 cm) pan, add the sugar, salt, and pectin and bring back to a simmer.","Cook, stirring constantly until the liquid has evaporated and the fruit begins to break down, 25-35 minutes.","To test if the jam is ready, remove the dish from the freezer and drop a spoonful of the jam onto it.","Let it sit there for 10-15 seconds, then drag your finger through it. If a clean line appears and remains, the jam is ready.","Let the jam sit in the pot for 10 minutes, then add the balsamic vinegar, and mix with a spoon.","Transfer the jam to a sterilized 1-pint (500 ml) glass jar, leaving a 3/8-inch (1 cm) head space.","Leave to cool, then cover and seal with a lid."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'ml', '7071dc99-45b3-559a-a839-8b6135c9755b', 'empty|place a shallow dish or saucer in the freezer  thoroughly wash the strawberry grapes and remove the stems  in a pot  using a potato masher  crush the grapes  cover with water  bring to a boil  and simmer for   minutes  strain out the water and transfer the grapes to a ricer or food mill and pass the mixture through to preserve the pulp but remove the seeds  place the grapes in an  inch   cm  pan  add the sugar  salt  and pectin and bring back to a simmer  cook  stirring constantly until the liquid has evaporated and the fruit begins to break down    minutes  to test if the jam is ready  remove the dish from the freezer and drop a spoonful of the jam onto it  let it sit there for   seconds  then drag your finger through it  if a clean line appears and remains  the jam is ready  let the jam sit in the pot for   minutes  then add the balsamic vinegar  and mix with a spoon  transfer the jam to a sterilized  pint   ml  glass jar  leaving a  inch   cm  head space  leave to cool  then cover and seal with a lid'),
	('be46da68-86f8-4557-be93-804b125926e0', NULL, 'Canary Melon Jam', '12:45:00', 500.00, '', NULL, '{"Peel and seed the melons.","Cut the flesh into 3/4-inch (2 cm) cubes.","You should end up with about 2 1/4 lb (1 kg) fruit.","In a bowl, toss the melon with the sugar, salt, lemon juice from 1 lemon, and ginger.","Cover with plastic wrap (cling film) and let sit in the fridge for at least 12 hours.","Place a shallow dish or saucer in the freezer.","Transfer the melon mixture to an 11-inch (28 cm) pan and cook over low heat until the sugar is dissolved.","Increase the heat to medium and cook, stirring constantly until the liquid has evaporated, 25-35 minutes.","To test if the jam is ready, remove the dish from the freezer and drop a spoonful of the jam onto it.","Let it sit there for 10-15 seconds, then drag your finger through it. If a clean line appears and remains, the jam is ready.","Let the jam sit in the pot for 10 minutes, add the juice of the second lemon, and mix with a spoon.","Transfer the jam to a sterilized 1-pint (500 ml) glass jar, leaving a 3/8-inch (1 cm) head space.","Leave to cool, then cover and seal with a lid."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'ml', '759e9192-b335-5883-8839-a61b909a6b5e', 'empty|peel and seed the melons  cut the flesh into  inch   cm  cubes  you should end up with about     lb   kg  fruit  in a bowl  toss the melon with the sugar  salt  lemon juice from   lemon  and ginger  cover with plastic wrap  cling film  and let sit in the fridge for at least   hours  place a shallow dish or saucer in the freezer  transfer the melon mixture to an  inch   cm  pan and cook over low heat until the sugar is dissolved  increase the heat to medium and cook  stirring constantly until the liquid has evaporated    minutes  to test if the jam is ready  remove the dish from the freezer and drop a spoonful of the jam onto it  let it sit there for   seconds  then drag your finger through it  if a clean line appears and remains  the jam is ready  let the jam sit in the pot for   minutes  add the juice of the second lemon  and mix with a spoon  transfer the jam to a sterilized  pint   ml  glass jar  leaving a  inch   cm  head space  leave to cool  then cover and seal with a lid'),
	('f230ae1c-ff6f-4496-ab26-4f865007501d', '65efb0ea-02fc-4a3b-91aa-a684b81b9ce3', 'Pasta negra', '01:20:00', 350.00, '', NULL, '{"Mezclar todos los ingredientes y trabajar hasta conseguir una masa fina y elstica.","Dejar reposar 1 hora en la nevera.","Estirar la pasta y cortar en forma de espaguetis.","Espolvorear con semolina."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '748cb8c5-fe9e-568e-a79e-a395144dc522', 'harina 00 huevos pequeos sal semolina tinta de calamar|mezclar todos los ingredientes y trabajar hasta conseguir una masa fina y elstica  dejar reposar   hora en la nevera  estirar la pasta y cortar en forma de espaguetis  espolvorear con semolina'),
	('1f745de7-979b-499f-976c-630301fb9e93', NULL, 'Berberechos', '00:20:00', 250.00, '', NULL, '{"Poner a hervir el agua con el hinojo e infusionar 10 minutos.","Volver a hervir y aadir los berberechos hasta que empiecen a abrirse.","Retirar y sacarlos de sus conchas.","Reservar en parte de su agua de coccin."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'g', '0074d0c2-61dd-5689-bca2-2312a9a68359', 'agua berberechos gordos hinojo seco en rama|poner a hervir el agua con el hinojo e infusionar   minutos  volver a hervir y aadir los berberechos hasta que empiecen a abrirse  retirar y sacarlos de sus conchas  reservar en parte de su agua de coccin'),
	('4e4ddf0d-4cb0-4dfe-bb7f-4e89e03ed451', NULL, 'Emulsin de albahaca', '00:10:00', 80.00, '', NULL, '{"Triturar las hojas y el pecorino Sardo con un poco de agua.","Condimentar y emulsionar con el aceite.","Colar, rectificar sabor, textura y reservar."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Preparation', 'ml', '3d997593-e998-51b2-aa09-0e2f1f69cc0d', 'aceite de oliva agua hojas de albahaca hojas de perejil pecorino sardo rallado pimienta blanca molida sal|triturar las hojas y el pecorino sardo con un poco de agua  condimentar y emulsionar con el aceite  colar  rectificar sabor  textura y reservar'),
	('c90144b8-7a9e-41e3-95ae-1d8052dfbfa3', '65efb0ea-02fc-4a3b-91aa-a684b81b9ce3', 'Espaguettis Negros con Berberechos, Gambas y Albahaca', '00:20:00', 350.00, NULL, NULL, '{"Cocer la pasta a la inglesa, dejndola al dente.","Saltear las gambas, condimentar.","Mezclar la pasta con los berberechos y la esencia de gambas.","Emplatar en sopero, aadir las gambas, la emulsin de albahaca, los brotes y las virutas de pecorino Sardo."}', 'e3aff5a8-485d-4444-9747-70e889380a50', NULL, 'Dish', 'g', '63a1362e-3f43-570f-97cf-548bf27d7e4f', 'berberechos brotes de albahaca emulsin de albahaca esencia de gambas gambas peladas pasta negra virutas de pecorino sardo|cocer la pasta a la inglesa  dejndola al dente  saltear las gambas  condimentar  mezclar la pasta con los berberechos y la esencia de gambas  emplatar en sopero  aadir las gambas  la emulsin de albahaca  los brotes y las virutas de pecorino sardo'),
	('011604f1-3e6a-4391-9ac8-edbc4f2f6dba', 'a2dc7af4-a700-4136-add9-286bf9b67490', 'Pichn con su Arroz de Cebolla', '00:40:00', 450.00, NULL, NULL, '{"Limpiar los pichones de plumillas y vsceras, deshuesar separando las pechugas de los muslos (si se parte de pichn entero).","Anacarar el arroz con el sofrito de cebolla en una cazuela.","Mojar con el fondo de cebolla caliente en pequeas cantidades, elaborando como un ''risotto'', removiendo constantemente.","Mientras cuece el arroz, reducir el fondo de pichn en un cazo aparte hasta obtener textura de demi-glace.","Frer los aros de cebolla pasados por la tempura para que queden crujientes; reservar.","Saltear los muslos de pichn confitados por el lado de la piel para que sta quede crujiente.","Saltear tambin las pechugas encrepinadas, dejndolas sangrantes por dentro pero doradas por fuera.","Acabar la coccin del arroz, ligndolo con su propio almidn y dejar reposar 3 minutos.","Calentar la demi-glace de pichn y ligar con la mantequilla.","Emplatar el arroz en platos soperos.","Colocar las pechugas cortadas y los muslos sobre el arroz.","Guarnecer con los aros de cebolla crujientes y salsear con la demi-glace de pichn."}', '7667066b-6a66-4fbf-8902-625d535798dc', NULL, 'Dish', 'g', '3d0734e8-59f7-5cfb-8873-1f2c692e4ae3', 'arroz bomba cebolla fondo de cebolla fondo de pichn mantequilla muslos de pichn confitados pechugas de pichn encrepinadas sofrito de cebolla tempura base|limpiar los pichones de plumillas y vsceras  deshuesar separando las pechugas de los muslos  si se parte de pichn entero  anacarar el arroz con el sofrito de cebolla en una cazuela  mojar con el fondo de cebolla caliente en pequeas cantidades  elaborando como un  risotto  removiendo constantemente  mientras cuece el arroz  reducir el fondo de pichn en un cazo aparte hasta obtener textura de demi glace  frer los aros de cebolla pasados por la tempura para que queden crujientes  reservar  saltear los muslos de pichn confitados por el lado de la piel para que sta quede crujiente  saltear tambin las pechugas encrepinadas  dejndolas sangrantes por dentro pero doradas por fuera  acabar la coccin del arroz  ligndolo con su propio almidn y dejar reposar   minutos  calentar la demi glace de pichn y ligar con la mantequilla  emplatar el arroz en platos soperos  colocar las pechugas cortadas y los muslos sobre el arroz  guarnecer con los aros de cebolla crujientes y salsear con la demi glace de pichn');
